var docs = {"00547443-abdb-4f41-bb6b-c3a0cf5076cf.json":{"content":"BH.IV.L2 \n[Picture] Chesney Wold\nThis note–legible as \"Picture\"–is deleted by Dickens and \"Chesney Wold\" written beneath. This could refer specifically to the portrait of Lady Dedlock, which is foregrounded in Guppy's tour of Chesney Wold in the prior monthly number and which is mentioned twice as \"My Lady's picture\" in chapter 12. However, the note most likely refers broadly to the \"picture\" of Chesney Wold and the operations of the \"fashionable world\" that are elaborated in some detail at the opening of chapter 12, as Dickens uses this same term in the memoranda for No. I (“Open country house picture”), No. XVIII (“Night Picture”) and No. XIX-XX (“Chesney Wold Picture”) to refer to these long descriptive scenes.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN04.json","id":"00547443-abdb-4f41-bb6b-c3a0cf5076cf.json"},"02dcdcfc-960b-4cc7-9ea6-79d04c102b4f.json":{"content":"BH.VII.R4 \nKrook getting on\nThe previous appearance of Krook in chapter 14 continued to place emphasis on his efforts to learn to read. These efforts are alluded to as the narrator describes the atmosphere of the \"long vacation\" at the beginning of chapter 19: \"In Mr Krook's court, it is so hot that the people turn their houses inside out, and sit in chairs upon the pavement–Mr Krook included, who there pursues his studies, with his cat (who never is too hot) by his side\" (BH 302). In chapter 20, however, these studies are not mentioned, and throughout emphasis is placed on his constant state of inebriation and its likely outcome (\"'If this is his regular sleep,' returns Jobling, rather alarmed, 'it'll last a long time one of these days, I am thinking'\") (BH 328). This note, then, could indicate Dickens's efforts to lay the groundwork for Krook's eventual demise midway through the novel.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"02dcdcfc-960b-4cc7-9ea6-79d04c102b4f.json"},"056fe8a9-6d2f-4639-903b-0fef14756ab0.json":{"content":"BH.XVIII.R2\nBeginning with the Water-side.\nBucket's first impulse in searching for Lady Dedlock is to see whether she has drowned herself, a common fate for disgraced women in the period. Esther eventually discovers her mother in the burial ground, but the mention of her \"long dank hair\" in that scene conjures the image of a drowned body evoked at the outset of the number: \"I was far from sure that I was not in a dream. We rattled with great rapidity through such a labyrinth of streets that I soon lost all idea where we were, except that we had crossed and re-crossed the river, and still seemed to be traversing a low-lying, waterside, dense neighbourhood of narrow thoroughfares chequered by docks and basins, high piles of warehouses, swing-bridges, and masts of ships. At length we stopped at the corner of a little slimy turning, which the wind from the river, rushing up it, did not purify; and I saw my companion, by the light of his lantern, in conference with several men who looked like a mixture of police and sailors. Against the mouldering wall by which they stood, there was a bill, on which I could discern the words, ‘Found Drowned’; and this and an inscription about drags possessed me with the awful suspicion shadowed forth in our visit to that place\" (BH 868-9).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"056fe8a9-6d2f-4639-903b-0fef14756ab0.json"},"05df9b8f-b5c9-4b71-8569-59de17fbce07.json":{"content":"BH.XIV.R4\nSir Leicester calls [at] on Mr Jarndyce\nIn the same way that Richard first appears in the novel's third-person narration in the prior number, chapter 43 brings about Sir Leicester's first direct appearance in Esther's first-person narration. While Esther had seen Sir Leicester at a distance in church during her first visit to Chesney Wold in chapter 18, her first personal meeting with him here in this chapter prompts her to disclose her knowledge of her parentage to Jarndyce.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"05df9b8f-b5c9-4b71-8569-59de17fbce07.json"},"0877b636-29aa-45ed-9cd6-120862d51fa3.json":{"content":"BH.XI.L2 \nMrs Bucket No.\nAlthough Dickens contemplates introducing Mrs Bucket as early as No. XI here, she is not mentioned explicitly until No. XV (chapter 49) and then more extensively in No. XVI (chapter 53) and No. XVII (chapter 54).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN11.json","id":"0877b636-29aa-45ed-9cd6-120862d51fa3.json"},"0bf80d71-51c8-40ee-a236-1c869d86fab4.json":{"content":"BH.XIX-XX.L2\nBetrothal day\nThe eventual union between Watt Rouncewell and Rosa had been part of Dickens's plan from very early in the composition. However, their union is incorporated into the conclusion of  the novel by being integrated into George's reunion with his brother, as his return and their betrothal occur on the same day. As Mr Rouncewell explains, \"This is a great day at home, and you could not have arrived, you bronzed old soldier, on a better. I make an agreement with my son Watt to-day, that on this day twelve-month he shall marry as pretty and as good a girl as you have seen in all your travels. She goes to Germany to-morrow, with one of your nieces, for a little polishing up in her education. we make a feast of the event, and you will be made the hero of it\" (BH 954).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"0bf80d71-51c8-40ee-a236-1c869d86fab4.json"},"0c6bd0c6-68c5-447f-b88e-0bd13b9c89c5.json":{"content":"BH.V.L4 \nSkimpole and Boythorn brought together?\nAlthough Skimpole and Boythorn are not \"brought together\" physically in this number, the two are directly compared by Esther after Skimpole mentions receiving a letter from him with details about the group's impending visit to Lincolnshire. Esther notes that she \"should have been surprised if [Skimpole and Boythorn] could have thought very highly of one another; Mr Boythorn attaching so much importance to many things, and Mr Skimpole caring so little for anything\" (BH 241). The two are brought together “next time” in chapter 18, as Skimpole travels with the group to stay with Boythorn.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"0c6bd0c6-68c5-447f-b88e-0bd13b9c89c5.json"},"0ca36375-ae31-4018-b68e-4ddce932eccf.json":{"content":"BH.XIV.R8\nSend Charley “for the letter.\"\nDickens toyed with the arrangement of this term at proof stage. In the final version this phrase is set off for emphasis: \"If you are sure of that, on good consideration, send Charley to me this night week–‘for the letter'\" (BH 689). However, the latter part of the sentence originally read \"send Charley to me for the letter this night week,\" which Dickens then altered in the corrected proofs. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"0ca36375-ae31-4018-b68e-4ddce932eccf.json"},"0cc1c2c4-78e1-4f52-91af-69a5300024ec.json":{"content":"BH.VI.L3 \nRosa [& W] and Watt? Slightly\nThe \"slightly\" here denotes the extent of Rosa and Watt's appearance in the number, rather than to how their growing connection is depicted. After Boythorn encounters Watt in the group's tour of the village, he tells Esther and the others: \"That's the housekeeper's grandson, Mr Rouncewell by name [...] and he is in love with a pretty girl up at the House. Lady Dedlock has taken a fancy to the pretty girl, and is going to keep her about her own fair person–an honour which my young friend himself does not at all appreciate\" (BH 287).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"0cc1c2c4-78e1-4f52-91af-69a5300024ec.json"},"0d93d808-649a-4d08-af80-5dac2e813d80.json":{"content":"BH.I\nAlthough Dickens deletes \"and the East Wind\" from the  heading of this note, the heading for the following number still reads \"Bleak House and the East Wind.\" This suggests that Dickens probably returned to this note to edit the heading after the composition of the number. Beginning with the third number, the headings read \"Bleak House.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN01.json","id":"0d93d808-649a-4d08-af80-5dac2e813d80.json"},"0e2210ed-840f-4887-827b-9ff789ceec8a.json":{"content":"BH.XVIII.R11\n“And it was my mother cold and dead.”\nDickens reworked the final sentence of the number carefully in the manuscript. Here, this final sentence originally reads: \"I went on to the [illegible deletion] gate and stooped down and turned the dank and long hair and it was my mother, cold and dead.\" Through edits it becomes what appears in the final published text: \"I passed on the gate, and stooped down. I lifted the heavy head, put the long dank hair aside, and turned the face. And it was my mother, cold and dead\" (BH 915).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"0e2210ed-840f-4887-827b-9ff789ceec8a.json"},"113e5ce9-66fd-4298-bdcc-22272d4f1f92.json":{"content":"BH.XII.L1 \nBring out Skimpole? Yes\nThis memorandum would seem to indicate that Dickens contemplated not only bringing Skimpole back into the narrative (he last appeared chapter 10, No. X), but also \"bring[ing] out\" the more sinister dimensions of Skimpole's childish naivete. While this is accomplished primarily through his influence on Richard and his connection to Vholes, his actions and behaviour are not substantially different from how he has appeared in the novel to this point. At the same time, Esther does comment explicitly on her growing discomfort with Skimpole: \"I thought I could understand how such a nature as my guardian's, experienced in the world, and forced to contemplate the miserable evasions and contentions of the family misfortune, found an immense relief in Mr Skimpole's avowal of his weaknesses and display of guileless candour; but I could not satisfy myself that it was as artless as it seemed; or that it did not serve Mr Skimpole's idle turn quite as well as any other part, and with less trouble\" (BH 594).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN12.json","id":"113e5ce9-66fd-4298-bdcc-22272d4f1f92.json"},"1163211c-36d5-4bcd-a583-6328fff1e684.json":{"content":"BH.XIII.R4\nGuppy and Tony – Court [...]\nThe physical setting of the chapter in \"Symond's Inn\" enables Dickens to transition from Vholes's meeting with Richard to Guppy and Tony's observation of the Smallweeds \"rummaging and searching, digging, delving, and diving among\" (BH 633) the inventory of Krook's shop. This transition between character groups is accomplished through Jobling's observation and comparison of Richard's \"smouldering combustion\" (BH 631) to Krook's Spontaneous Combustion in No. X. The appearance of Tulkinghorn at the end of the chapter also sets up the parallel between Richard's growing resentment towards Jarndyce and the \"grim shadow\" that descends on Tulkinghorn through the rest of the number, first through his meeting with Lady Dedlock and then with Hortense.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"1163211c-36d5-4bcd-a583-6328fff1e684.json"},"133358a3-ea0a-4420-bdfa-6482796559f2.json":{"content":"BH.XVII\nDickens had planned to retreat to Boulogne in early June to complete the final numbers of Bleak House. In early May, he declined several engagements, citing the oppressiveness of London in the summer months. To John de Gex on the 9th of May, for example, Dickens wrote: \"My attention is so fully occupied just now, that I am going to retreat for some months, early in June, to work in peace and quiet—an absolute impossibility in London at this time of the year when all the nations of the earth bring letters of introduction and Britannia is for ever asking her children out to all manner of social endurances” (Letters 7.82). In early June, though, Dickens was ill in bed for nearly a week, delaying his departure and his composition of No. XVII. On the 11th of June he wrote to Lady Eastlake from Folkestone: \"I have been ill and in great pain–six days in bed, for the first time in my life [...] Since Monday last, I have been shaving a man every morning–a stranger to me–with big gaunt eyes and a hollow cheek–whose appearance was rather irksome and oppressive\" (Letters 7.95). The Dickenses had a \"delightful passage\" on Sunday the 12th (Letters 7.98), with Dickens feeling \"immensely better\" and \"bracing [him]self up for the great attempt of Tuesday morning\" to begin writing the installment (Letters 7.96). His work appears to have progressed smoothly from there, as Dickens sent the \"lettering for the plates\" to Bradbury & Evans prior to beginning writing. On the 18th he reported to W.H. Wills: \"Thank God I have done half the No. with great ease, and hope to finish on Thursday or Friday next. O how thankful I feel to be able to have done it, and what a relief to get the No. out!\" (Letters 7.99). He appears to have indeed finished on Thursday the 23rd, writing playfully to Frank Stone at \"the earliest opportunity after finishing my Number\" to say that \"any person of undoubted pluck in want of a customer, may hear of me at the bar of Bleak House, where my money is down\" (Letters 7.100). ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN17.json","id":"133358a3-ea0a-4420-bdfa-6482796559f2.json"},"1461e9ad-d894-4872-a538-9df45cdecc5b.json":{"content":"BH.VI.R1\n“O! It’s all right enough. [...]\nThe appearance of this phrase in the final text–which Richard repeats twice–comes very close to matching this note (Richard first says, \"O yes, it's all right enough. Let us talk about something else,\" and then repeats: \"O, it's all right enough. Let us talk about something else\" (BH 269-70). However, in the manuscript Dickens first writes \"O yes, it's all right enough but talk about something else,\" before deleting the \"but\" and inserting the \"Let us\" above.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"1461e9ad-d894-4872-a538-9df45cdecc5b.json"},"1583fae1-adf9-4293-9325-2d720b1091d1.json":{"content":"BH.V.R2 \nGridley, the man from Shropshire\nThe novel's critique of the Court of Chancery draws on an 1849 treatise written by Dickens's solicitor William Challinor titled \"The Court of Chancery; Its Inherent Defects as Exhibited in Its System of Procedure and of Fees; with Suggestions for a Remedy.\" The details of Gridley's case, elaborated by him in chapter 15, are drawn by Dickens from the historical case of Thomas Cook, which Challinor presents in his pamphlet. Challinor had sent Dickens his pamphlet in March 1852 after reading the first number of Bleak House (Letters 6.623).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"1583fae1-adf9-4293-9325-2d720b1091d1.json"},"158b8189-bfad-43ba-981b-9a9acc7fe92e.json":{"content":"BH.XIV.L2\nBoythorn. – About him, but not himself\nBoythorn and Skimpole are consistently paired in Dickens's memoranda (for example: Nos. V, VI, and IX). In order to \"br[ing] out\" Jarndyce's love for Esther in this number, Dickens must negotiate incompatible narrative situations. Esther's disclosure of her mother's identity to Jarndyce (which prompts his proposal) is brought about by her meeting with Sir Leicester, who calls on Jarndyce to apologize for how his conflict with Boythorn prevented him from inviting Jarndyce to Chesney Wold. While Boythorn and his engagement to Miss Barbary is part of Esther's disclosure to Jarndyce, this same conflict prevents Boythorn \"himself\" from appearing in the number since Boythorn and Sir Leicester cannot both be present together due to their long-running dispute.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"158b8189-bfad-43ba-981b-9a9acc7fe92e.json"},"17510abb-1c11-487c-a618-2c912e477bf4.json":{"content":"BH.XVI.L1\nEsther and Allan? Yes. Carry on gently.\nCaddy's illness in chapter 50 provides the opportunity for Woodcourt's re-entrance, as Jarndyce inquires about Caddy's doctor and suggests Woodcourt become her regular attendant. This takes Esther \"by surprise\" and \"For a moment, all that [she] had had in her mind in connexion with Mr Woodcourt seemed to come back and confuse [her]\" (BH 770). This connection is \"carr[ied] on gently\" in the chapter by way of Esther's misinterpretation of Ada's reserve. Esther notices a \"change in my dear girl\" and comes to \"fee[l] sure that Ada suppressed this something from me, lest it should make me unhappy too\" (BH 774-775). Esther goes on: \"It came into my head that she was a little grieved–for me–by what I had told her about Bleak House\" [i.e, her engagement to Jarndyce]. The change in Ada is a result of her undisclosed marriage to Richard (revealed in chapter 51), and so Esther's original assumption that Ada feels unhappy for her might be seen as Esther (in the presence of Woodcourt) expressing her own uncertainty about her engagement to Jarndyce (despite her protestations: \"How I persuaded myself that this was likely, I don't know. I had no idea that there was any selfish reference in doing so. I was not grieved for myself: I was quite contented and quite happy. Still, that Ada might be thinking–for me, though I had abandoned all such thoughts–of what once was, but was not all changed, seemed so easy to believe, that I believed it\"). The subtle changes to the chapter's final phrase (see opposing page) help highlight that the distance between Esther and Ada is not simply the product of a \"shadow on\" Ada that results from her \"suppress[ing]\" something from Esther, but rather a \"shade between\" the two women that results from them both suppressing something. Esther acknowledges this more explicitly (if still obliquely) at the conclusion of chapter 51 following Jarndyce's remark about Bleak House \"thinning fast\": \"I was sorry presently that this was all we said about that. I was rather disappointed. I feared I might not quite have been all I had meant to be, since the letter and the answer\" (BH 791).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"17510abb-1c11-487c-a618-2c912e477bf4.json"},"18508913-a14c-4110-94a5-3f405b7c73a0.json":{"content":"BH.VIII.R5 \nThe shadow of Miss Flite on Richard\nAlthough this note foregrounds the \"shadow\" Miss Flite leaves upon Richard, in the text itself emphasis also falls on the bond between Miss Flite and Gridley: \"The sun was down, the light had gradually stolen from the roof, and the shadow had crept upward. But, to me, the shadow of that pair, one living and one dead, fell heavier on Richard's departure than the darkness of the darkest night\" (BH 405-6).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN08.json","id":"18508913-a14c-4110-94a5-3f405b7c73a0.json"},"1bebf11d-fd14-45da-9d98-c55bf9aff314.json":{"content":"BH.IX.R1 \nSharpshooters\nThe titles for chapters 26 and 27 were added in ink at proof stage and do not appear in the manuscript. There is a deleted (and illegible) title to chapter 26 in the proofs, which Dickens replaced with the final title, \"Sharpshooters.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"1bebf11d-fd14-45da-9d98-c55bf9aff314.json"},"1bf05da3-221e-4efb-8999-4d67b2c5b066.json":{"content":"BH.V\nThe writing on the left-hand side of the Working Note appears unusually rushed and sloppy. The writing on the right-hand side of the Note is more composed and legible. On the right-hand side of the Note, the ink for the title heading and chapter headings is distinctly different (lighter) than the ink for all of the chapter notes. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"1bf05da3-221e-4efb-8999-4d67b2c5b066.json"},"1c25e2e5-376b-408d-8f9b-c8f3a40a31bd.json":{"content":"BH.XIV.R11\nAllan – Jenny – Jo\nAlthough chapter 46 marks a shift from Esther's first-person narration to the third-person narration, Allan Woodcourt provides a thread of continuity. At the close of Esther's encounter with Allan in chapter 45, he tells Esther that he is going to London \"'To-morrow or the next day'\" (BH 707).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"1c25e2e5-376b-408d-8f9b-c8f3a40a31bd.json"},"1c9d83b2-8fcb-41a1-9544-0ed09bff7da0.json":{"content":"BH.II.L2\nForeshadowing Legend of the Country house\nAlthough the third chapter of the number (chapter 7) does contain the legend of \"The Ghost's Walk\" of Chesney Wold, it is less a \"foreshadowing\" of that legend than the full recounting of the legend which “foreshadows” later developments in the plot, as Mrs Rouncewell relates the history of the Dedlocks from the period of the English Civil War to Guppy, Rosa, and Watt Rouncewell as they tour Chesney Wold. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN02.json","id":"1c9d83b2-8fcb-41a1-9544-0ed09bff7da0.json"},"1cebd8f8-0d85-4ce7-98aa-4b3d4a612cfc.json":{"content":"BH.I.R1\nchapter II.\nDickens wrote to his publisher Evans on 7 Dec 1851 that he had \"only the last short chapter to do, to complete No. I\" (Letters 6.550). As Harry Stone and others have documented, Dickens had originally planned for three chapters in this opening number, before inserting this short second chapter and renumbering the following chapters. This renumbering also appears in the manuscript. As H.P. Sucksmith explains, the insertion of this chapter occurred after the other three chapters had been composed (since in the manuscript, chapters II and III are altered to III and IV, respectively), but before he began composition of No. II, which begins in the manuscript with chapter V (64). The chapter heading and title for chapter 2 are in a darker ink and appear to have been added to the note later (along with the third  stroke added to make \"chapter II\" into \"chapter III,\" as well as the deletion of \"III\" and the substitution of \"IV\" below\").\nIt appears that Dickens, by default, initially planned each monthly number of Bleak House to comprise three chapters, spacing out the chapter headings (but not chapter titles) evenly on the right-hand side of the working notes. In all of the monthly numbers that contain four chapters (Nos. I, IX, XIII, XIV, and XVI), that fourth chapter appears squeezed into the Notes as an addition, usually at the bottom of the note.","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN01.json","id":"1cebd8f8-0d85-4ce7-98aa-4b3d4a612cfc.json"},"1f545802-d7db-4937-99b3-129c8cfb63a1.json":{"content":"BH.XVIII.L4\nExplain the change of clothes [...]\nThe dramatic effect of the discovery of Lady Dedlock's body is heightened by the discrepancy between the reader's understanding and Esther's lack of comprehension or recognition of the state of affairs prior to the conclusion of the chapter when she finally sees her mother's face. While the reader has plenty of opportunity and knowledge to piece together the fact that Lady Dedlock has exchanged clothes with Jenny, Bucket's efforts to illuminate Esther ensure this is clear: \"'Miss Summerson, you'll understand me, if you think a moment. They changed clothes at the cottage.' They changed clothes at the cottage. I could repeat the words in my mind, and I knew what they meant of themselves; but I attached no meaning to them in any other connection. 'And one returned,' said Mr Bucket, 'and one went on. And the one that went on, only went a certain way agreed upon to deceive, and then turned across country, and went hom. Think a moment!' I could repeat this in my mind too, but I had not the least idea what it meant. I saw before me, lying on the step, the mother of the dead child\" (BH 915).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"1f545802-d7db-4937-99b3-129c8cfb63a1.json"},"20406d15-756e-4b6c-b1ab-0d373a94be49.json":{"content":"BH.XIII.R6\nCarry through Rouncewell and Rosa [...]\nThe notes for chapters 40-42 provide a fairly straightforward summary of events. The short notes \"Carry on to next\" above and \"So to next\" here highlight both the continuity of narrative action in the number, but also the difficulty of establishing clear demarcations between chapters. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"20406d15-756e-4b6c-b1ab-0d373a94be49.json"},"27375a10-72ce-4dcd-8dba-640e4016e7e1.json":{"content":"BH.XIX-XX.L7\nMiss Flite and her birds\nMiss Flite and her birds appear twice, albeit briefly, in the final number. Towards the end of chapter 60, Esther encounters Miss Flite in Symond's Inn, where she informs Esther that she has appointed Richard as her executor in her will, and added two birds named \"the Wards in Jarndyce\" to her collection (BH 922). At the end of chapter 65, following the dissolution of the Chancery suit and Richard's death, Esther makes a brief and abrupt mention of Miss Flite: \"When all was still, at a late hour, poor crazed Miss Flite came weeping to me, and told me that she had given her birds their liberty\" (BH 979). Given the persistent connections between Miss Flite (and her birds) and the Jarndyce suit, as well as her strong connections to Richard in the second half of the novel, her inclusion in the final numbers in this manner feels perfunctory. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"27375a10-72ce-4dcd-8dba-640e4016e7e1.json"},"291725cc-552b-41ca-a544-c450f60e9e83.json":{"content":"BH.XIV.R3\nAngry baker – such an absurd figure.\nIn the manuscript, this description of the angry baker is first written as \"the figure of an angry baker.\" \"Figure\" is deleted, and above that (after another written and deleted phrase), the formulation \"absurd figure\" appears. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"291725cc-552b-41ca-a544-c450f60e9e83.json"},"2bf174a0-d2f7-47af-96eb-b6cdface07ff.json":{"content":"BH.VII.L2 \nThe Turveydrops No. Next time\nWhen he wrote these memoranda for No. VII, it appears he had not yet determined how the narration of the number would be distributed across the first- and third-person narrators. In the end, all three chapters are narrated by the novel's third-person narrator (this is also the case with Nos. IX & XV). Since the Turveydrops only appear in Esther's portion of the narrative, Dickens may have been considering the possibility of her narrating one or more of the number's chapters.","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"2bf174a0-d2f7-47af-96eb-b6cdface07ff.json"},"30181261-35c2-4cb6-974e-d18303c5fe40.json":{"content":"BH.II\nThe Working Note for the second number of Bleak House is notable for its relative simplicity, as the left memoranda detail the basic content of the three chapters, and the right side only lists the chapter titles. \nOverall, this particular Note is interesting not simply for its paucity in the Bleak House series, but also for its relative neglect. For instance, while Dickens likely returned to the Working Note for No. I to delete \"and the East Wind\" from the heading, here the original working title remains intact (Dickens does delete \"and the East Wind\" from the heading of the first manuscript page of this number). Similarly, although Dickens changed Leonard Skimpole's name to Harold during the proof stage, he does not return to the Note here to document that change. Later Notes, however, contain such documentation, such as when Dickens returns to the Note for No. IV to record the change from \"Little Cheeks\" to \"Swills\" and the Note for No. VI to record the change of Jobling's assumed name from \"Owen\" to \"Weevle.\" ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN02.json","id":"30181261-35c2-4cb6-974e-d18303c5fe40.json"},"3033b989-d0bd-4577-bec8-73e6feb96f07.json":{"content":"BH.V.R1 \nDeportment.\nTitles for chapters 14 and 15 do not appear in the corrected proofs (either in print or ink). This would suggest that they were added during a second stage of proofs (which have not been preserved) and were then retroactively added to the manuscript and Working Note. This is supported by the manuscript itself, as the title of chapter 14 is written over deleted text at the start of the chapter. A verso side of a manuscript page also contains an aborted beginning to chapter 15, where Dickens begins the chapter without including a title, before abandoning it to begin again on a new sheet. Dickens returned the final set of proofs on the 15th of June, directing the printer to go to press with the number once those final corrections were made (Letters 6.695). Dickens also instructed the printer not to send the final proofs to Forster, who had, for several weeks, been “very ill with Rheumatic gout” (Letters 6.682).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"3033b989-d0bd-4577-bec8-73e6feb96f07.json"},"3184400e-1da4-4b89-be01-35940c667f5f.json":{"content":"BH.IV.R3 \nRiding from Paris home\nMany of these notes for chapter 12 reference sections of the manuscript that Dickens has edited and revised significantly. The paragraph describing Lady Dedlock's departure from Paris (\"Riding from Paris home\") is heavily edited, and the paragraph following the introduction of the \"Brilliant and distinguished circle\" is rewritten entirely. Similarly, the initial description of Hortense, the \"French Lady's maid,\" is revised significantly in the manuscript.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN04.json","id":"3184400e-1da4-4b89-be01-35940c667f5f.json"},"31d494dc-2c69-464f-a3dd-bc35fa898b45.json":{"content":"BH.XIII.L1\nKrook’s Cat. Yes.\nWhile Guppy and Jobling encounter (and comment on) Lady Jane as they return to Jobling's lodgings to pack up his belongings, the first part of chapter 39 also makes mention of Vholes's \"official\" cat as it \"watches the mouse's hole\" (BH 629) during his conference with Richard. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"31d494dc-2c69-464f-a3dd-bc35fa898b45.json"},"3420959e-4e48-4ebd-858b-a4a36bebde0d.json":{"content":"BH.XVIII.R1\nJourney through the snow.\nOn the 29th of June, prior to or in the early stages of composing No. XVIII, Dickens wrote to Hablot K. Browne to \"send the subjects for the next No.\" (Letters 7.107). Dickens also requested that these two sketches, \"The Night\" and \"The Morning,\" be sent to him in Boulogne \"by post\" to review. By the 6th of July, Dickens had evidently reviewed the sketches and approved of them, writing playfully to Browne: \"Mon cher Brune. If I express myself, not altogether in the perfect English of your country, pardon me for tout-ce que je fais. J'ai si longtemps demeuré–on the Continent–que j'ais presqu'oublié my native tongue. My friend, il me parait–that the esquisses seront--admirable–when they shall be finished according to your so wondrous power of art. I them return–ci-enclos. Yet I am enchanted of the hope you give me–de vous reçevoir chez moi à Boulogne!\" (Letters 7.111)\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"3420959e-4e48-4ebd-858b-a4a36bebde0d.json"},"35eaf41d-d06f-423e-b9b7-ad40a3ead4a0.json":{"content":"BH.XI.L1 \nRichard – No.\nAs in the previous monthly number, Dickens considers including Richard, only to defer his appearance. Although Richard does not appear in this installment, Dickens does manage–as the directive note for chapter 35 indicates–to \"work in\" Richard and his relationship with Ada through Miss Flite's chilling account of the \"dreadful attraction\" (BH 566) of Chancery and her concern over its growing influence over Richard.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN11.json","id":"35eaf41d-d06f-423e-b9b7-ad40a3ead4a0.json"},"392dd7e0-3258-4c43-bd41-a52326783bf2.json":{"content":"BH.XVI.R9\nBucket & Mercury.\nMuch of the initial exchange between Bucket and Mercury in this chapter is added at proof stage, with Dickens composing the following on a separate hand-written sheet and attaching it to the proofs for inclusion in the final printed text; this brief initial exchange provides some lead-in to their more extensive exchange at the end of the chapter, in which Bucket pries Mercury for knowledge of Lady Dedlock's movements on the night of Tulkinghorn's murder: \n \n\"If Mercury should chance to be possessed by any lingering curiosity as to Mr. Bucket's letters, that wary person is not the man to gratify it. Mr. Bucket looks at him as if his face were a vista of some miles in length and he were leisurely contemplating the same.\n‘Do you happen to carry a box?’ says Mr. Bucket.\nUnfortunately Mercury is no snuff-taker.\n‘Could you fetch me a pinch from anywheres?’ says Mr. Bucket. ‘Thankee. It don't matter what it is; I'm not particular as to the kind. Thankee!’\n \nHaving leisurely helped himself from a canister borrowed from somebody downstairs for the purpose, and having made a considerable show of tasting it, first with one side of his nose and then with the other, Mr. Bucket, with much deliberation, pronounces it of the right sort and goes on, letter in hand\" (BH 805-6).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"392dd7e0-3258-4c43-bd41-a52326783bf2.json"},"3b05c93a-6024-4c43-85dd-b423a65c95ff.json":{"content":"BH.VIII\nSince this Working Note contains no memoranda on the left-hand side, it lacks the characteristic question-and-answer format that usually reflects Dickens's return to the Working Note at multiple stages of the compositional process. Nevertheless, differences in pen on the right-hand side of the Note indicate that Dickens visited this note at several distinct moments in the composition of this installment. For chapters 23 and 24, the chapter titles and chapter notes appear to have been written with a different pen or nib than the chapter headings. And for chapter 25, the chapter heading, chapter title, and chapter notes all appear distinct, based on the nib used.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN08.json","id":"3b05c93a-6024-4c43-85dd-b423a65c95ff.json"},"3b9440c1-8834-4876-b40a-f2ee969cc490.json":{"content":"BH.XIX-XX.L3\nMr Snagsby. No\nIn contrast to the typical \"Yes\" and \"No\" replies that Dickens adds to the characters and events in his left-hand memoranda across the Working Notes for Bleak House, the check marks added indicate that Dickens was less contemplating his options than reminding himself of characters he needed to incorporate into the final double number. The \"no\" next to Mr Snagsby is a notable exception. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"3b9440c1-8834-4876-b40a-f2ee969cc490.json"},"3e1f6fff-9cf1-4741-93f2-2b801c27b2a5.json":{"content":"BH.XVIII.R10\n“Bring her round somehow in the Lord’s name!”\nAs with the memorandum above in chapter 57 (\"I have got it by the Lord!\"), Bucket's phrase appears in the final text in a slightly different formulation, without reference to the \"Lord.\" Bucket asks Woodcourt: \"Would you look to this girl and see if anything can be done to bring her round\" (BH 906). Bucket does use the phrase \"by the Lord\" in this chapter, but this phrase seems to have been associated with Bucket in Dickens's mind.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"3e1f6fff-9cf1-4741-93f2-2b801c27b2a5.json"},"41124f6a-5a5f-4f96-b9d4-8900993ddad3.json":{"content":"BH.XVIII.R5\nCarry on suspense\nThe supsense around Lady Dedlock's fate is \"Carr[ied] on\" in chapter 58 less by the events of the chapter and more by the simple suspension of Esther's narration in the midst of their pursuit of her. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"41124f6a-5a5f-4f96-b9d4-8900993ddad3.json"},"41b315f2-ef7f-40f1-b9fb-394c08feabf0.json":{"content":"BH.XII\nThe majority of the monthly numbers comprise a mixture of first- and third-person narration, and five monthly numbers (VII, IX, XIII, XV, XVII) are narrated entirely in the third-person. Monthly No. XII is the only number in the novel narrated entirely in the first person by Esther.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN12.json","id":"41b315f2-ef7f-40f1-b9fb-394c08feabf0.json"},"4218fce5-956d-4953-ba2a-ceaacc41a689.json":{"content":"BH.IV \nDickens composed No. IV at the start of May while he was busy preparing for his theatrical tour of Birmingham and Shrewsbury and also celebrating the birth and christening of his tenth child (born March 13th). On the 1st of May he wrote to Frank Stone that he was trying to complete No. IV and that it was \"rather a stunner\" (Letters 6.655). Although the chapter memoranda for this number remain sparse, Dickens seems to have felt confident in the novel's opening numbers and was buoyed by initial strong sales. In a letter to Lavinia Watson, Dickens confided: \"Five and thirty thousand, every publishing day, is the present mark of Bleak House, thank God!\" (Letters 6.666). In a longer letter to William F. De Cerjat on the 8th of May he expressed how he \"look[s] forward to good things whereof the foundations are built\" (Letters 6.670) and credited the strong sales to the success of Copperfield: \"[Bleak House] is a most enormous success; all the prestige of Copperfield (which was very great) [is] telling upon it, and raising its circulation above all my other books.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN04.json","id":"4218fce5-956d-4953-ba2a-ceaacc41a689.json"},"43809847-c811-4b92-b5a6-d4dd1c27c142.json":{"content":"BH.XIII.R3\nRichard’s decline – Carry on.\nDickens \"carr[ies] on\" the \"decline\" Richard in the chapter through his growing resentment against Jarndyce, who becomes the \"embodiment\" (BH 626) of the injustice Richard suffers through the \"abstraction\" of the Chancery suit. This decline is also manifested structurally insofar as this is the first time where Richard appears in the novel's third-person narration. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"43809847-c811-4b92-b5a6-d4dd1c27c142.json"},"43b57e1f-6298-44fa-8b21-8a1f778f80a6.json":{"content":"BH.IX.L1 \nBoythorn? Skimpole?\nIn contrast to the previous number, where the left-hand memorandum side of the Working Note is blank, Dickens returns here to his frequent practice of outlining potential characters to appear in the installment. At the same time, he does not–with the exception of the final entry for the Rouncewells and Rosa–return to this list to record his decisions. Many of these characters–Boythorn, Skimpole, Hortense, and Weevle–do not appear. Boythorn and Skimpole are particularly interesting in this regard because, like Turveydrop in No. VII, they only ever appear in Esther's first-person narration (Boythorn is frequently mentioned by Sir Leicester in the third-person narration, but never physically appears in those sections). As with No. VII, this number ends up being narrated entirely in the third-person, but Dickens's initial memoranda here indicate that he had not made that determination from the outset of his planning for the number.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"43b57e1f-6298-44fa-8b21-8a1f778f80a6.json"},"43b857e8-af64-49ed-b9f4-53e53903cfae.json":{"content":"BH.V.R3 \nPointing hand of allegory\nThis note refers to the brief mention of Mr Tulkinghorn in his chambers, following an \"alarming\" visit from the \"disappointed suitor\" Gridley: \"From the ceiling, foreshortened Allegory, in the person of one impossible Roman upside down, points with the arm of Samson (out of joint, and an odd one) obtrusively toward the window. Why should Mr Tulkinghorn, for such no-reason, look out of window? Is the hand not always pointing there? So he does not look out of the window\" (BH 259). Had Tulkinghorn looked out of the window, we are told, he would have seen a woman leaving Chesney Wold (Lady Dedlock, dressed as in Hortense's clothing). The \"Pointing hand\" then appears at the end of the chapter, as Jo shows Lady Dedlock the spot where Nemo is buried, which appears in the second illustration of the number. The Working Note for No. XV refers twice to the “Pointing Roman.”\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"43b857e8-af64-49ed-b9f4-53e53903cfae.json"},"45e21ffb-8cbf-4208-b309-fcaaa2860934.json":{"content":"BH.XVI.L2\nSir Leicester? Very little. [...]\nThis memorandum seems to refer to the full disclosure of Lady Dedlock's dishonour and its effect on Sir Leceister. He does appear somewhat prominently in chapter 53 in a forceful declaration to Bucket of his intent to capture Tulkinghorn's murderer, but this appearance is indeed \"very little\" in comparison to what happens in the following number. As H.P. Sucksmith has suggested, these notes highlight Dickens’s careful treatment of the \"double function\" the Dedlocks serve in the novel: as members of the ruling class, they are subject to Dickens's \"satiric vision,\" while the broader \"tragic irony\" governing the novel requires them to be pitied as well (62-63). Sucksmith argues that the planning here around Sir Leicester in the number furthers the \"readjustment of sympathy towards\" him required at this stage of the novel (63).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"45e21ffb-8cbf-4208-b309-fcaaa2860934.json"},"462d6d06-1092-4fff-aca4-6e82a21a9c8b.json":{"content":"BH.XIX-XX.L1\nGrandfather Smallweed and the Will?\nGiven the nature of the memoranda on this page–a list of events and relationships, rather than queries–this particular question stands out, particularly since there would seem to be little uncertainty around whether the final number would include the resolution of Chancery suit. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"462d6d06-1092-4fff-aca4-6e82a21a9c8b.json"},"46d17501-6556-445b-b4ed-d78c7af351f3.json":{"content":"BH.X.R4 \nConnect Esther & Jo?\nIn No. V, Lady Dedlock and Jo are of course connected physically in the plot, and that connection is used by the narrator for larger conceptual and thematic purposes (\"What connexion can there be...\"). In the Working Note for No. VII, Dickens records that Tulkinghorn \"finds Jo [...] and gets him to identify Lady Dedlock\" through Hortense's outfit. No. X not only connects Esther and Jo, but does so in a way that furthers this pattern and prepares the ground for the revelation of Lady Dedlock as Esther's mother at the beginning of No. XII. In chapter 31, Jo–in his fever-induced delirium–\"stare[s] at [Esther] with a remarkable expression of surprise and terror,\" thinking that she is the woman he took to the \"berryin gound\" (BH 490-1). Jo's query whether \"there [are] three of 'em then?\" (BH 493) furthers the proliferation and mirroring of Lady Dedlock's image in Esther, seen also in Guppy's fixation on the various portraits of Lady Dedlock and the image of Esther \"imprinted on my art\" (BH 464). In addition to the note below where Dickens emphasizes that Esther's love for Woodcourt \"must be kept in view,\" he has clearly been preparing the groundwork for the revelation of Lady Dedlock as Esther's mother. Dickens wrote to Burdett Coutts on Nov. 19th (after completion of No. X): \"I have been so busy, leading up to the great turning idea of the Bleak House story, that I have lived this last week or ten days in a perpetual scald and boil\" (Letters 6.805).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"46d17501-6556-445b-b4ed-d78c7af351f3.json"},"4cd8cf37-25a9-4464-b1a1-b10795b581f2.json":{"content":"BH.XIII.R2\nMake man-eating unlawful [...]\nThis phrase, which concludes the long description of Vholes that opens chapter 39, appears to have been devised by Dickens in the process of composing the chapter. While the phrase in the Working Note matches the final text, the phrase goes through several (deleted and illegible) permutations in the manuscript before Dickens arrives at this particular formulation.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"4cd8cf37-25a9-4464-b1a1-b10795b581f2.json"},"4fb09856-2624-4600-aa08-186fbaf18a4a.json":{"content":"BH.XIV.R5\n[Esther xxxx]\nThere is another word following Esther that has been deleted, which Harry Stone transcribes as \"tells\" but which is not clearly legible.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"4fb09856-2624-4600-aa08-186fbaf18a4a.json"},"4fc0234a-d2fa-49c2-88ff-c4ac097a504b.json":{"content":"BH.XIV.R10\nEsther to – Plymouth – no – Deal\nThis note is a rare instance of Dickens revising the right-hand chapter notes through \"dialogue\" with himself, rather than simple deletion. This process of moving this location from Plymouth to Deal is reflected in the manuscript as well, where the paragraph mentioning Richard's station is heavily revised, and the phrase \"go down to Deal\" appears amid abundant deletion in a very minuscule hand. Plymouth is the location of Her Majesty's Naval Base Devonport, and thus a logical place for Richard to be stationed; however, by moving this location to Deal, Dickens is able to have Esther encounter Woodcourt upon his return.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"4fc0234a-d2fa-49c2-88ff-c4ac097a504b.json"},"50d2da42-18e2-4bed-b4f1-8448dca6a183.json":{"content":"BH.XIX-XX.L6\nLady Dedlock in the Mausoleum [...]\nThe novel's penultimate chapter opens with this \"Picture\" of the mausoleum at Chesney Wold and a slightly more substantial description of Lady Dedlock's place amongst the deceased: \"Some of her old friends, principally to be found among the peachy-cheeked charmers with the skeleton throats, did once occasionally say, as they toyed in a ghastly manner with large fans—like charmers reduced to flirting with grim death, after losing all their other beaux—did once occasionally say, when the world assembled together, that they wondered the ashes of the Dedlocks, entombed in the mausoleum, never rose against the profanation of her company. But the dead-and-gone Dedlocks take it very calmly and have never been known to object\" (BH 981).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"50d2da42-18e2-4bed-b4f1-8448dca6a183.json"},"5132c1d8-6a79-4938-b131-526f025a7e12.json":{"content":"BH.X.R6 \nEsther’s love must be kept in view [...]\nAlthough Caddy's marriage to Prince Turveydrop–which occupies the bulk of chapter 30–brings the question of Esther's own romantic prospects into view, Dickens amplifies these issues in the opening of the chapter through Mrs Woodcourt’s visit to Bleak House. While Esther's conversations with Mrs Woodcourt–and her evasive narration–continues to draw out her love for Woodcourt, Mrs Woodcourt's overbearing (if highly ironized) aristocratic pretensions further establish a union of Esther and Woodcourt as a kind of \"victory\" and one that is based on \"meritorious[ness].\"\n \nIn a letter from November 22nd, Dickens was presumably referring to these elements of the plot when he wrote to Lavinia Watson: \"I have just now come to the point [in Bleak House] I have been patiently working up to in the writing, and I hope it will suggest to you a pretty and affecting thing\" (Letters 6.807).","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"5132c1d8-6a79-4938-b131-526f025a7e12.json"},"533dccc1-a135-4036-9da0-fb0cb9fc7f09.json":{"content":"BH.VII.L1 \nMr Guppy – His mother? Not yet\nAlthough this note indicates Dickens's intention to introduce Guppy's mother–and although Guppy himself appears frequently through the middle sections of the novel–Mrs Guppy herself will not appear until chapter 38 in No. XII.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"533dccc1-a135-4036-9da0-fb0cb9fc7f09.json"},"56794c00-6b01-4889-b116-bcb11a8194ac.json":{"content":"BH.XVI.R5\nRichard living in [...]\nHaving already located Vholes in Symond's Inn on Chancery Lane in chapter 39, Dickens decides to locate Richard in close proximity to his lawyer. The Inns of Chancery date from the middle of the 14th century and eventually came to be used as offices and accommodations for solicitors. By the nineteenth century, the single unified association of solicitors diminished the function of the Inns. Symonds Inn dated from the 17th century and was located on the east side of Chancery Lane, south of High Holborn; it was demolished in 1873. While working as a lawyer's clerk in the late 1820s, Dickens appears to have worked in legal chambers located in Symond's Inn (among others) (see Parker). Cursitor Street is located to the southeast and where the Snagsbys live. Both Carey Street (west of Chancery Lane) and Dyer's Buildings (further east of Chancery Lane) are also nearby.  \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"56794c00-6b01-4889-b116-bcb11a8194ac.json"},"58c22ae9-4d65-44b3-9999-24868efbb675.json":{"content":"BH.XVIII.L2\nEnding with the churchyard gate [...]\nThese memoranda offer a rare example of Dickens explicitly planning out the shape and structure of an entire number in these left-hand notes. Coupled with the lead notes to chapter 58 (\"Carry on suspense\") and chapter 59 (\"Take up from the first chapter\") on the opposing page, these notes indicate how Dickens structured the number via the trajectory of Bucket's arrival at Bleak House to retrieve Esther at the start of the number, to Esther's discovery of Lady Dedlock's body, which concludes the number. Dickens also sent the \"subjects\" for the installment’s two illustrations to Hablot K. Browne on the 29th of June, the second of which presents this image of Lady Dedlock \"lying dead upon the step\" (see annotation on \"Journey through the Snow\" opposite).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"58c22ae9-4d65-44b3-9999-24868efbb675.json"},"58c6698f-1ba6-4362-baf9-d28ed871e316.json":{"content":"BH.XI.R6 \n[chapter XXXVI.]\nIt is difficult to determine at what point in the process of conception and composition that Dickens contemplated and ultimately decided against including a fourth chapter in No. XI. Evidence from elsewhere in the novel–particularly No. IX–suggests that throughout Bleak House Dickens began each number with a default structure of three chapters, only adding a fourth if required during the actual composition of the number. However, the inclusion and subsequent deletion of the chapter heading for chapter 36 would suggest that at some point Dickens conceived of including a fourth chapter in this number. While the placement of the notes on this sheet suggest the distribution of material across two chapters, there is no indication in the manuscript of a chapter break that was subsequently removed. It could be that Dickens at some point planned this material across two chapters (as the imperative directive \"work in\" suggests a note written prior to composition), but then combined them into one, perhaps due to space constraints (and then returning to the Working Note to delete the chapter heading). It is also possible that the notes here were simply added around the deleted chapter heading.","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN11.json","id":"58c6698f-1ba6-4362-baf9-d28ed871e316.json"},"5b4fca1c-ab3b-4584-a791-534c5bef38c9.json":{"content":"BH.XVII.R1\nSpringing a Mine.\nThe titles for chapters 54 and 55 were added in ink to the corrected proofs and do not appear in the manuscript. The title for chapter 56 appears in the manuscript and typeset in the corrected proofs.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN17.json","id":"5b4fca1c-ab3b-4584-a791-534c5bef38c9.json"},"6228677d-3957-4b2d-b618-96e6982f3dc7.json":{"content":"BH.XVIII.R6\nBring Sir Leicester and George together.\nWhile Sir Leicester calls for George mid-way through chapter 58 after learning he has returned and been reunited with his mother, the manuscript contains a later passage where Sir Leicester calls for George after he becomes \"worse; restless, uneasy, and in great pain\" as night approaches (BH 896). Dickens deleted this exchange at proof stage so the later discussion only focuses on Sir Leicester and Mrs Rouncewell:\n \n“‘George,’ she whispers softly, when Volumnia has gone down to dinner, ‘Sir Leicester don’t like the thought of shutting out my Lady for another night. Go away a little while, my dear. I’ll speak to him.’\nThe trooper retires, and Mrs. Rouncewell takes her chair at the bedside.\n‘Sir Leicester.’\n‘That’s Mrs. Rouncewell?’\n‘Surely, yes, Sir Leicester.’\n‘I was afraid you had left me.’\nHis hand is lying close beside her. She kisses it.\n‘It’s the dull one,’ says Sir Leicester. ‘But I feel that, Mrs. Rouncewell.’\nIt is too dark to see him; she thinks, however, that he puts his other hand before his eyes.\n‘Where is your son, George? He is not gone? I want him here. I want only you and him; I would rather have no one else to-night.’\n‘He hoped he might be of some use and he is not gone, Sir Leicester.’\n \n‘I thank him!’”\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"6228677d-3957-4b2d-b618-96e6982f3dc7.json"},"6298e29e-e6ad-433e-91e2-7c78c4778c8b.json":{"content":"BH.XII.R6 \nRemind Caddy of “the Sweeps”\nCaddy's comparison of the dancing-master's apprentices to \"Sweeps\" arriving each day on the doorstep is a reference to young boys who labored in the period as chimney-sweeps, but the reference also resonates in the novel with the image of the crossing-sweep Jo.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN12.json","id":"6298e29e-e6ad-433e-91e2-7c78c4778c8b.json"},"63355816-7697-4784-bebe-8d34e69ab4a3.json":{"content":"BH.X.R5 \nMrs Snagsby?\nAs with Miss Flite, Mrs. Snagsby does not ultimately appear in the number but is briefly mentioned. Charley is the proximate means by which Esther and Jo become connected, as she brings Esther to the brickmaker's cottage where Jo has arrived, ill with smallpox. In recounting his travels, though, Jo remarks: \"'I have been moved on, and moved on, more nor ever I was afore, since the t'other one giv' me the sov'ring. Mrs Snagsby, she's always a watching, and a driving of me–what have I done to her? and they're all a watching and a driving of me'\" (BH 491).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"63355816-7697-4784-bebe-8d34e69ab4a3.json"},"69d05a47-7a99-456c-920a-dadfa7c904cf.json":{"content":"BH.XVIII.L3\nMr Boythorn? No\nAlthough Boythorn does not appear in the number, his name is mentioned by Esther as one possible destination of her mother's flight, so that Bucket–like Dickens–contemplates the possible relevance of Boythorn to their unfolding pursuit: \"His manner was very keen, and yet considerate when he explained to me that a great deal might depend on my being able to answer, without confusion, a few questions that he wished to ask me. These were, chiefly, whether I had had much communication with my mother (to whom he only referred as Lady Dedlock), when and where I had spoken with her last, and how she had become possessed of my handkerchief. When I had satisfied him on these points, he asked me particularly to consider—taking time to think—whether within my knowledge there was any one, no matter where, in whom she might be at all likely to confide under circumstances of the last necessity. I could think of no one but my guardian. But by and by I mentioned Mr. Boythorn. He came into my mind as connected with his old chivalrous manner of mentioning my mother's name and with what my guardian had informed me of his engagement to her sister and his unconscious connexion with her unhappy story\" (BH 866-7).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"69d05a47-7a99-456c-920a-dadfa7c904cf.json"},"6a529406-aa9b-4583-8968-4aa85340d5f2.json":{"content":"BH.XVII.R3\n“My Lodger.”\nBucket's exposition of his efforts to gather evidence of Hortense's guilt finally reveals the role of Mrs Bucket, whom the Working Notes show Dickens had considered introducing in No. XI and then again in No. XV. Although she does not make a physical appearance here or in the novel at all, Bucket explains her surveillance of Hortense while she is lodged in their house: “Sir Leicester Dedlock, Baronet, this case could never have been the case it is but for Mrs. Bucket, who is a woman in fifty thousand—in a hundred and fifty thousand! To throw this young woman off her guard, I have never set foot in our house since, though I've communicated with Mrs. Bucket in the baker's loaves and in the milk as often as required. My whispered words to Mrs. Bucket when she had the sheet in her mouth were, ‘My dear, can you throw her off continually with natural accounts of my suspicions against George, and this, and that, and t'other? Can you do without rest and keep watch upon her night and day? Can you undertake to say, “She shall do nothing without my knowledge, she shall be my prisoner without suspecting it, she shall no more escape from me than from death, and her life shall be my life, and her soul my soul, till I have got her, if she did this murder?”’ Mrs. Bucket says to me, as well as she could speak on account of the sheet, 'Bucket, I can!' And she has acted up to it glorious!\" (BH 834)\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN17.json","id":"6a529406-aa9b-4583-8968-4aa85340d5f2.json"},"6b0b8dcf-3eb1-4a49-9253-02da3118e1c5.json":{"content":"BH.VI.L2 \nBoythorn and Skimpole. Yes. Not much\nThis note about Boythorn and Skimpole is carried forward from the previous Working Note, where Dickens queries whether the two should be \"brought together.\" While Esther considers the contrast between the two men explicitly in the prior number, in chapter 18 that contrast is largely dramatized. Early in the chapter the contrast is drawn through their juxtaposed reflections on the punctuality of the coach. Later in the chapter, a much more thorough contrast is drawn through their reflection on Sir Leicester, which ends with Esther remarking: \"This was one of the many little dialogues between them, which I always expected to end, and which I dare say would have ended under other circumstances, in some violent explosion on the part of our host\" (BH 294).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"6b0b8dcf-3eb1-4a49-9253-02da3118e1c5.json"},"6d7aac93-39dd-4c18-bb0a-a56453434119.json":{"content":"BH.VII.R3 \n“There are chords –”\nThis phrase, which Guppy uses to both announce his devotion to Esther and deflect direct discussion of it, appears several times throughout the chapter. The narrator also adopts it once through the free indirect mode toward the end of the chapter: \"They then report progress to the eminent Smallweed, waiting at the office in his tall hat for that purpose, and separate; Mr Guppy explaining that he would terminate his little entertainment by standing treat at the play, but that there are chords in the human mind which would render it a hollow mockery\" (BH 330).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"6d7aac93-39dd-4c18-bb0a-a56453434119.json"},"6e37f313-4a5e-49c5-9b8c-bc8bac88ffb1.json":{"content":"BH.VII.R2 \nAssumed name Owen Weevle.\nIn the manuscript, Jobling's pseudonym is presented as \"Mr Owen\" throughout chapter 20. Dickens makes this change from “Owen” to “Weevle” in the corrected proofs, where in the first instance he changes it to \"Morgan,\" before changing it to \"Weevle.\" All subsequent appearances of the name are then changed to Weevle in the corrected proofs.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"6e37f313-4a5e-49c5-9b8c-bc8bac88ffb1.json"},"6e5f6aa5-738d-4425-98e7-700368c7dc94.json":{"content":"BH.XVI.L3\nBoythorn? In connexion with Lady Dedlock? No.\nAlong with the working notes for Nos. XIV and XVIII, this note suggests Dickens contemplated a more significant role for Boythorn in the resolution of Lady Dedlock's plot line. In all of these instances, Dickens concludes by curtailing, deferring, or rejecting the presence of Boythorn, and he only appears through brief mentions by Esther until the novel's final double number. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"6e5f6aa5-738d-4425-98e7-700368c7dc94.json"},"7027bfcb-1743-47df-b86f-87edd858ec91.json":{"content":"BH.VI.R4 \nMoving on.\nIn the manuscript, chapter 19 is originally given a different title, which is deleted and no longer legible. It is, however, significantly longer than the eventual title of \"Moving on.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"7027bfcb-1743-47df-b86f-87edd858ec91.json"},"71e97dbc-f1e0-4733-97ce-a7d28a69a0d4.json":{"content":"BH.VI.R5 \nThe great remedy for Jo [...]\nDickens made a short trip to St. Albans in the middle of June–\"looking about me,\" he wrote in a letter, \"for Bleak House purposes\"–before beginning composition of No. VI in early July. Dickens wrote to the Governor of St. Albans prison and asked if he could visit the Jail \"if it should not be inconsistent with any of its regulations\" (Letters 6.695-96). The editors of Dickens's letters suggest that he might have been pondering later developments related Jo, who comes to St. Albans in chapter 31, bringing with him the smallpox that will infect Charley and then Esther (Letters 6.695). Jo, though, is \"moved on\" through the work of Skimpole, rather than arrested. \n \nDickens clearly had Jo and \"all such as he\" on his mind in late June when replying to John Laurie, who sent Dickens a copy of his book The Voice of Humanity: a Work of Mercy (published 1852). While Laurie's work focuses on the plight of discharged convicts, in writing to thank Laurie, Dickens says that \"one of the most monstrous evils of this country\" is \"the neglect of its wretched youth until they become criminals, and cost God only knows how much–in money, waste, and ruin\" (Letters 6.698). Dickens goes on: \"Mr. Laurie scarcely does Mr. Dickens justice, if he suppose that Mr. Dickens does not use his pen in this matter. He has tried, in most of his writing to present it in some striking light; and it is not excluded from the book he is now publishing.\"","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"71e97dbc-f1e0-4733-97ce-a7d28a69a0d4.json"},"734fbb50-a876-4810-8427-8c4a853d2fe3.json":{"content":"BH.III.L1 \nRichard and Ada – love. Yes, Slightly\nThe third and fourth paragraphs of chapter 9–which detail the developing love between Richard and Ada–are heavily revised and edited in the manuscript. On the one hand, the \"Slightly\" here seems to refer more to length than subtlety, as Esther's is very explicit about the love that blossoms between the two wards very early in their time at Bleak House: \"He was very, very, very fond of Ada. I mean it, and I had better say it at once. I had never seen any young people falling in love before, but I found them out quite soon\" (BH 137). On the other hand, Dickens does make an effort to temper the sense of foreboding that hangs over the courtship. A later paragraph that describes Richard's character and his care for Ada is also heavily revised in the manuscript, and in the proofs Dickens deletes a significant phrase. Esther narrates: \"I believe Richard's was as frank and generous a nature as there possibly can be. He was ardent and brave, and in the midst of all his wild restlessness, was so gentle that I knew him like a brother in a few weeks. His gentleness was natural to him and would have shown itself abundantly even without Ada's influence; but with it, he became one of the most winning of companions, always so ready to be interested and always so happy, sanguine, and light-hearted\" (BH 139-40). At the conclusion of that final sentence, Dickens deleted the parenthetical aside: \"(although there was already an indefinite shadow of separation upon us).\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN03.json","id":"734fbb50-a876-4810-8427-8c4a853d2fe3.json"},"736f2c7c-fe53-40be-b2dd-7bad3e16de4c.json":{"content":"BH.XVIII.R7\n“who will tell him”\nThis phrase is first spoken by Mrs Rouncewell in conversation with George: \"'I am thankful I have lived long enough to be with Sir Leicester in this illness and trouble, for I know I am not too old nor too useless to be a welcomer sight to him than anybody else in my place would be. But the step on the Ghost's Walk will walk my Lady down, George; it has been many a day behind her, and now it will pass her and go on.' 'Well, mother dear, I say again, I hope not.' 'Ah, so do I, George,' the old lady returns, shaking her head and parting her folded hands. 'But if my fears come true, and he has to know it, who will tell him!'\" (BH 889). It is then taken up by the narrator and repeated three more times in the chapter, including at its very conclusion: \"The day comes like a phantom. Cold, colourless, and vague, it sends a warning streak before it of a deathlike hue, as if it cried out, 'Look what I am bringing you who watch there! Who will tell him!'\" (BH 900).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"736f2c7c-fe53-40be-b2dd-7bad3e16de4c.json"},"745a9c7f-e6be-407e-9445-5f51871bef50.json":{"content":"BH.IV.L4 \nMiss Jellyby? No.\nAs in the previous monthly number, Dickens contemplates including Miss Jellyby, only to defer her appearance. Dickens picks up this thread of the plot at the start of the next monthly number in chapter 14, which introduces Miss Jellyby's courtship with Prince Turveydrop. Despite Mrs. Jellyby's prominent appearance the novel's opening numbers, she only makes fleeting appearances through the remainder of the novel, as attention shifts predominantly to Caddy and her relationship with Prince. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN04.json","id":"745a9c7f-e6be-407e-9445-5f51871bef50.json"},"76cba3b3-5f5b-4529-8202-ec38b9bb4d03.json":{"content":"BH.I.R4\nLaw Writer.\nThis note references the climactic conclusion of chapter 2, where Lady Dedlock notices the handwriting on the affidavits that Mr Tulkinghorn has brought, asks about the identity of the writer, and then faints. The peculiar phrasing here—\"work up from this moment\"—highlights Dickens's concern with handling the disclosure of the relationship between Lady Dedlock and Captain Hawdon. Although this note refers to the \"Law Writer,\" the scene and chapter also lay the ground for the dynamic between Lady Dedlock and Mr Tulkinghorn, which is \"work[ed] up\" gradually over the course of the novel.   ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN01.json","id":"76cba3b3-5f5b-4529-8202-ec38b9bb4d03.json"},"7732c426-b542-409e-902b-1d2cb6d4eff3.json":{"content":"BH.III.R1 \nCovering a Multitude of Sins.\nThe title for chapter 8 was added in ink to the corrected proofs of the manuscript, suggesting that Dickens returned to the manuscript and Working Note to document it. The catch-all nature of this title (\"Covering a Multitude of Sins\") is particularly resonant with this post hoc feeling. The chapter begins with Jarndyce's commentary on Chancery and his discussion with Esther about the possibilities for Richard's future, which is followed by the introduction of Mrs Pardiggle and her family. The chapter ends with Mrs Pardiggle taking Esther and Ada on one of her visitations to the brickmaker's home, where they encounter his violence toward his wife and witness the death of their baby. The length of the chapter, coupled with the diverse nature of the issues and events depicted, make it hard to imagine a single idea or phrase that could identify a central theme of the chapter. It is clear, if nothing else, that no title presented itself to Dickens when he first composed the chapter, and this improvised title at proof stage seems an easy if somewhat unimaginative way to introduce and \"cover\" the material of the chapter. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN03.json","id":"7732c426-b542-409e-902b-1d2cb6d4eff3.json"},"78ec44f9-a13e-4810-9b29-ba8d225b5174.json":{"content":"BH.XV.R3\nGather up Ironmaster and Rosa\nEven though this imperative is less striking than the memo to \"Kill [Jo]\" on the left-hand side, it is nevertheless distinctive among the Working Notes for Bleak House. The need to \"gather up\" Robert Rouncewell and Rosa indicates that–since Dickens has decided to \"lead up\" to Tulkinghorn's murder through the Dedlock's house in town–the pair need to be removed from Lincolnshire where, to this point in the novel, they have only appeared.","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN15.json","id":"78ec44f9-a13e-4810-9b29-ba8d225b5174.json"},"7928e447-533e-41e3-960a-4748b77059b7.json":{"content":"BH.VIII.R3 \nan appeal Case.\nThe title for chapter 24 is added in ink to the corrected proofs and does not appear in the manuscript.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN08.json","id":"7928e447-533e-41e3-960a-4748b77059b7.json"},"79299755-91aa-4eda-abc5-a3f87649d1dc.json":{"content":"BH.XVIII.L1\nAll Esther’s Narrative? No. \nAlthough the novel does contain one number narrated entirely by Esther (No. XII), Dickens decides against that structure here, as the number's middle chapter (ch. 58) interrupts the two chapters of \"pursuit\" narrated by Esther.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"79299755-91aa-4eda-abc5-a3f87649d1dc.json"},"79a9a979-d135-4dd4-99d1-c442885b5355.json":{"content":"BH.XIII\nBy late February 1853, Dickens was feeling the pressures of his many commitments. On the 18th of February, he promised Burdett Coutts that he would \"write to [her] again as soon as I am out of Bleak House for the month.–I am very near the door\" (Letters 7.26). Late in the month he wrote to Forster: \"What with Bleak House and Household Words and Child's History and Miss Coutt's Home, and the invitations to feasts and festivals, I really feel as if my head would split like a fired shell if I remained here\" (Letters 7.34). Dickens's responsibilities for Household Words had been compounded by W.H. Wills's recent illness (\"He too has been twice ill with bad eyes”) (Letters 7.36). Dickens departed for Brighton at the beginning of March, where he stayed for two weeks and composed the next monthly number.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"79a9a979-d135-4dd4-99d1-c442885b5355.json"},"7cf3e287-8c69-45b9-b600-930475668b92.json":{"content":"BH.XIX-XX.R1\nMrs Woodcourt and Allan. Prepare the way.\nIn addition to Esther's engagement to Jarndyce, the other barrier to her eventual union with Woodcourt is his mother's class pretensions that prejudice her against Esther. At the start of the chapter, Esther's discloses that Mrs Woodcourt has come to stay with them \"on my guardian's invitation\" (BH 916); this, as we learn in chapter 64, is part of Jarndyce's direct effort to take Mrs Woodcourt \"into a separate confidence\" (BH 965) and provide her an opportunity to observe Esther and Allan together. In chapter 60, Jarndyce's discussion of Mrs Woodcourt with Esther precipitates one of her characteristic evasions of her inner feelings: \"I had nothing to say against [Mrs Woodcourt coming to stay]. I could not have suggested a better arrangement; but I was not quite easy in my mind. Esther, Esther, why not? Esther, think!\" (BH 919).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"7cf3e287-8c69-45b9-b600-930475668b92.json"},"7e98a7ce-9343-467e-a99f-6ea1a6dfc3ab.json":{"content":"BH.IX.R6 \nchapter XXIX.\nFollowing the first monthly number, each installment comprised three chapters to this point. The different color of inks on this Working Note–as well as the spacing of the chapter headings–indicate that Dickens had, as usual, planned for three chapters but decided on four in the process of composing the number.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"7e98a7ce-9343-467e-a99f-6ea1a6dfc3ab.json"},"800d7ce6-afcd-49f5-8a1e-037478345b5b.json":{"content":"BH.XIX-XX.R5\nHis letter to Esther about the paper\nCoupled with the memorandum on the opposing page (\"The letter George gave Mr Tulkinghorn\"), this note highlights Dickens’s feeling that he needed to revisit these key plot points around Esther's parentage, and Tulkinghorn's discovery of it. In the process, George's letter also resolves any sense of wrongdoing on George's part in that discovery; as he writes to Esther: \"I further take the liberty to make known to you, that [Hawdon's letter] was got from me as a proof of hand-writing only, and that otherwise I would not have given it up as appearing to be the most harmless in my possession, without being previously shot through the heart\" (BH 958).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"800d7ce6-afcd-49f5-8a1e-037478345b5b.json"},"829e30d5-0bd9-4b80-a97e-9056d8b0961c.json":{"content":"BH.XVI.R1\nAnd a poor little child\nThe opening paragraphs of chapter 50, which announces Caddy's illness, are heavily revised and reworked in the manuscript. This particular phrase, though, reads \"Such a poor little baby\" in both the original manuscript and final published text. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"829e30d5-0bd9-4b80-a97e-9056d8b0961c.json"},"857fc982-013d-425c-bebe-622cd037dcc0.json":{"content":"BH.XIII.R7\nLondon bird.\nDickens invokes the image of a bird at the very outset of the novel to trace the movement between spaces. After the opening of the novel in London in the first chapter, the second chapter moves to a description of Chesney Wold: \"It is but a glimpse of the world of fashion that we want on this same miry afternoon. It is not so unlike the Court of Chancery, but that we may pass from the one scene to the other, as the crow flies\" (BH 20). Here, the same image is invoked and applied to Tulkinghorn himself and his movement between Lincolnshire and London: \"Like a dingy London bird among the birds at roost in these pleasant fields, where the sheep are all made into parchment, the goats into wigs, and the pasture into chaff, the lawyer, smoke-dried and faded, dwelling among mankind but not consorting with them, aged without experience of genial youth, and so long used to make his cramped nest in holes and corners of human nature that he has forgotten its broader and better range, comes sauntering home. In the oven made by the hot pavements and hot buildings, he has baked himself dryer than usual; and he has in his thirsty mind his mellowed port-wine half a century old\" (BH 661).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"857fc982-013d-425c-bebe-622cd037dcc0.json"},"85cddf87-a646-4cf9-bb95-84cf098d2e85.json":{"content":"BH.XVIII.R8\nTake up from first chapter\nThroughout Bleak House, Dickens usually titles chapters \"Esther's Narrative\" at the start of a number, to signal to readers and perhaps emphasize to himself the change in narratorial mode. The exceptions to this practice are chapter 13 (the first time the title is used) and chapter 35. No. XVIII is the only number where two chapters have this same title, which might be interpreted as an effort to highlight the continuity between these two chapters of Esther’s narration that are interrupted by chapter 58.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"85cddf87-a646-4cf9-bb95-84cf098d2e85.json"},"86436d98-85aa-4a98-890d-3622e039b88c.json":{"content":"BH.V.L2 \n[Jo] Jo? Yes\nThe final chapter of this number (chapter 16) contains one of the novel's most famous passages, where the third-person narrator asks: \"What connexion can there be, between the place in Lincolnshire, the house in town, the Mercury in powder, and the whereabout of Jo the outlaw with the broom\" (BH 256). The memoranda for the number as a whole highlight the work the number does to make \"connexions\" between the various clusters of characters that have been introduced in the opening installments of the novel. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"86436d98-85aa-4a98-890d-3622e039b88c.json"},"86ba8974-1150-443c-b309-ef0b29f4c4c6.json":{"content":"BH.IX.R5 \na threatening, murdering, dangerous fellow\nThis phrase, uttered by Tulkinghorn, is used to describe Gridley, not George, but becomes associated with George by chance and subsequently fuels suspicions around George following Tulkinghorn's murder. When George returns to Tulkinghorn's chambers following his consultation with the Bagnets, Tulkinghorn recalls the link between  George and the now-deceased Gridley, telling George: \"'I don't like your associates. You should not have seen the inside of my door this morning, if I had thought of your being that man [who sheltered Gridley]. Gridley? A threatening, murderous, dangerous fellow'\" (BH 445). As George departs, however, \"a clerk coming up the stairs has heard the last words of all, and evidently applies them to him. 'A pretty character to bear,' the trooper growls with a hasty oath, as he strides down-stairs. 'A threatening, murderous, dangerous fellow!' and looking up, he sees the clerk looking down at him, and marking him as he passes a lamp.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"86ba8974-1150-443c-b309-ef0b29f4c4c6.json"},"8748f96c-d49c-44e8-9d4b-356562ead7bc.json":{"content":"BH.XIX-XX.R6\nMr Guppy’s magnanimity\nWhen Dickens sent through the subjects for the illustrations to No. XVIII Hablot K. Browne on June 29th, he added: \"I am now ready with four subjects for the concluding double No. and will post them to you tomorrow or next day!!!!!!!!!!!!\" (Letters 7.107). Although the letter with those subsequent instructions does not survive, the four subjects are the two plates for the final double number (\"The Magnanimous Conduct of Mr. Guppy\" and \"The Mausoleum at Chesney Wold\"), as well as the Frontispiece and Vignette Title for the novel. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"8748f96c-d49c-44e8-9d4b-356562ead7bc.json"},"8a57bc92-53a9-4d06-b314-046b9c38e6ba.json":{"content":"BH.III.L3 \nNew people – Mrs Pardiggle\nDickens makes note here of Mrs Pardiggle as one of the \"New people\" introduced in this number (along with the \"new traits\" displayed by Richard), but the number also contains other new characters of significance, including the brickmaker and his wife Jenny, Boythorn, and Mr and Mrs Snagsby (along with their servant Guster). Following the publication of No. III, Dickens explained in a letter to Lavinia Watson on the 6 May 1852 that \"Mr. Boythorn is (between ourselves) a most exact portrait of Walter Savage Landor” (Letters 6.666).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN03.json","id":"8a57bc92-53a9-4d06-b314-046b9c38e6ba.json"},"8b0230dd-c11d-4b7b-9bc5-d1ab625a9b95.json":{"content":"BH.II.L1\nLeonard Skimpole\nThat Dickens based the character of Skimpole on Leight Hunt (1784-1859) is one of the more well-documented aspects of the novel's compositional history. Dickens made significant changes to Skimpole's character between the initial drafting of the second monthly number and its eventual publication in April 1852. The initial description of Skimpole shows significant revision and rewriting in the manuscript. At proof stage, these revisions continue: Dickens changes his name from \"Leonard\" to \"Harold,\" continues adjusting the descriptions of his character, and even directed Hablot K. Browne to ensure that Skimpole's figure did not resemble Hunt's physical appearance in the number's second plate. All of these changes were made to reduce the correspondence between Skimpole and Hunt and were prompted by Forster's objections. In a letter to Forster, likely from 9 March 1852, Dickens writes, \"I enclose proofs of No. 2. Browne has done Skimpole, and helped to make him singularly unlike the great original. Look it over, and say what occurs to you\" (Letters 6.623). Much evidently did occur to Forster, as Dickens writes to him on the 17 March, after consulting Bryan Waller Procter on the matter: \"You will see from the enclosed, that Procter is much of my mind. I will nevertheless go through the character again in the course of the afternoon, and soften down words here and there\" (Letters 6.628). Dickens follows up the next day, writing: \"I have again gone over every part of it very carefully, and I think I have made it much less like. I have also changed Leonard to Harold. I have no right to give Hunt pain, and I am so bent upon not doing it that I wish you would look at all the proof once more, and indicate any particular place in which you feel it particularly like. Whereupon I will alter that place\" (Letters 6.628). The editors of Dickens's letters note that some of the deletions in the proofs are in Forster's hand (Letters 6.628fn5). \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN02.json","id":"8b0230dd-c11d-4b7b-9bc5-d1ab625a9b95.json"},"917a2838-723a-427c-8621-b5e5025caa5d.json":{"content":"BH.VI.R7 \nA man with a good deal of train oil [...]\nThe wording in the final text is slightly different: \"Mr Chadband is a large yellow man, with a fat smile, and a general appearance of having a good deal of train oil in his system\" (BH 304-5).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"917a2838-723a-427c-8621-b5e5025caa5d.json"},"92a4d21f-9ea0-43ee-b6ea-7163ccd3270e.json":{"content":"BH.IX.R4 \nTell him my opinion, old girl\nThe text (both in manuscript and in printed form) is slightly different from this phrase: \"'Old girl,' says Mr Bagnet, 'give him my opinion. You know it. Tell him what it is'\" (BH 443). Something closer to this formulation does appear in chapter 34: \"'Old girl!' murmurs Mr Bagnet, after a short silence, 'will you tell him my opinion?'\" (BH 542).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"92a4d21f-9ea0-43ee-b6ea-7163ccd3270e.json"},"93308059-0d47-4be2-9b76-0f1e75552f85.json":{"content":"BH.XVI.R7\nObstinacy.\nLike the previous chapter, Dickens appears to have entertained a different title for chapter 52. A longer (now deleted and illegible) title appears in the manuscript, which is replaced by \"Obstinacy.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"93308059-0d47-4be2-9b76-0f1e75552f85.json"},"938ff768-fad2-40ed-b15c-fbfeb7e794cc.json":{"content":"BH.V.L1 \nRichard. No.\nThe prior number ends with Richard embarking upon his education in medicine, and Esther’s narration at the outset of the chapter begins: \"Richard left us on the very next evening, to begin his new career, and committed Ada to my charge with great love for her, and great trust in me\" (BH 214-215). While Dickens has developed Richard's character considerably in the prior numbers, he does not appear in this number. Dickens does, however, continue to intimate the tragic horizon of Richard's development and his relationship with Ada. Esther continues: \"It touched me then to reflect, and it touches me now, more nearly, to remember (having what I have to tell) how they both thought of me, even at that engrossing time\" (BH 215).  \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"938ff768-fad2-40ed-b15c-fbfeb7e794cc.json"},"96f102e5-2075-4125-b166-cbdd6910a422.json":{"content":"BH.IV.L1 \nLittle Cheeks Swills \nIn this memorandum, Dickens seems to be contemplating possible names for the \"comic vocalist\" who will appear at the Coroner's Inquest. In the manuscript, the first three times this name is written as \"Little Cheeks.\" In each instance, however, Dickens returns–in what appears to be a different ink–to delete the name and replace it with \"Swills,\" and by the end of the chapter he is using \"Little Swills.\" This would suggest that mid-way through drafting the chapter Dickens decided to change the name of the character from \"Little Cheeks\" to \"Little Swills,\" but does not return to the Working Note to delete one in favor of the other. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN04.json","id":"96f102e5-2075-4125-b166-cbdd6910a422.json"},"9769b31e-105e-4549-ba85-b1d4190764ad.json":{"content":"BH.VI\nAt least some of No. VI appears to have been composed during a short trip Dickens made in early July to Folkestone (south of Dover). On Saturday, July 3rd, Dickens wrote to Burdett Coutts: \"Instead of coming to you tomorrow, I will write from Folkestone! For my Muse has hung fire so much this last week, and I am so persecuted by people with letters of introduction of all kinds, that I really have worried myself (and been worried) into the belief that I cannot write without a change, and am going down there tomorrow morning, to remain until about Wednesday. [...] I feel as if I had been thinking my brain into a sort of cabbage net\" (Letters 6.704). No letters survive from July 4-6, but Dickens replies to several correspondents on the 7th saying that he has just returned to London from Folkestone.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"9769b31e-105e-4549-ba85-b1d4190764ad.json"},"98bb55cb-b916-4657-861a-72bce6fb7f4c.json":{"content":"BH.XI.R4 \nMr George sees his mother.\nAs with many aspects of the Rouncewell family, the Working Notes show Dickens's clear conception and careful planning of the gradual disclosure of George's reunion with his family. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN11.json","id":"98bb55cb-b916-4657-861a-72bce6fb7f4c.json"},"9a98ad99-18e3-418d-907d-fa8bd0c519c6.json":{"content":"BH.XIX-XX.R2\nAda and Richard – Prepare the way.\nAs Ada's frank disclosure of her fears about Richard to close the chapter indicate, Dickens opens the number by \"prepar[ing] the way\" for Richard's death. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"9a98ad99-18e3-418d-907d-fa8bd0c519c6.json"},"9bbc4047-1935-495c-a4ee-16dcd582bf17.json":{"content":"BH.IX.R3 \nStrong box.\nThe boxes in Tulkinghorn's chambers are mentioned when his quarters in town are first described in chapter 10: \"Here, among his many boxes labelled with transcendant names, lives Mr. Tulkinghorn, when not speechlessly at home in country-houses where the great ones of the earth are bored to death. Here he is today, quiet at his table. An oyster of the old school whom nobody can open\" (BH 158). At the outset of chapter 27, Mr Smallweed makes particular note of the strong box to George as he speculates that Tulkinghorn is “worth a mint of money” and also “knows a thing or two\" (BH 432). However, no further mention of Tulkinghorn's strong box (or boxes in general) is made in the remainder of the novel. This note could suggest that Dickens perhaps imagined later using the strong box in relation to the Tulkinghorn's collection of evidence. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"9bbc4047-1935-495c-a4ee-16dcd582bf17.json"},"9c59f482-5937-4885-9156-85c7aca8d30b.json":{"content":"BH.X.L3 \n“She will try to make her way [...]\nThese phrases from the close of chapter 31 directly match their formulations in the manuscript.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"9c59f482-5937-4885-9156-85c7aca8d30b.json"},"9e6c7d77-171e-4f38-803d-7f55c9a96b31.json":{"content":"BH.XVI.R6\n“Not going home my dear [...]\nThe wording of this phrase in the manuscript and the final text is different: \"'Esther, dear,' she said very quietly, 'I am not going home again.' A light shone in upon me all at once. 'Never any more. I am going to stay with my dear husband. We have been married above two months. Go home without me, my own Esther; I shall never go home any more!'\" (BH785-6).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"9e6c7d77-171e-4f38-803d-7f55c9a96b31.json"},"9ebf2e7f-c135-4ff0-abff-e0b1e730441e.json":{"content":"BH.XII.R2 \nThe Ghost’s Walk\nThe second illustration of the number is of The Ghost's Walk, and Esther herself draws explicit attention to the fact that her present situation, as she treads the pathway on the evening of her meeting with her mother, is a fulfillment of the family legend: \"Stopping to look at nothing, but seeing all I did see as I went, I was passing quickly on, and in a few moments should have passed the lighted window, when my echoing footsteps brought it suddenly into my mind that there was a dreadful truth in the legend of the Ghost's Walk; that it was I, who was to bring calamity upon the stately house; and that my warning feet were haunting it even then\" (BH 586). While the reader is familiar with the legend from the repeated references to it in the third-person narration, Esther herself must become aware of it in order to make this connection. Dickens accomplishes this briefly early in the chapter by having Esther introduce the legend: \"A picturesque part of the Hall, called The Ghosh's Walk, was seen to advantage from this higher ground; and the startling name, and the old legend in the Dedlock family which I had heard from Mr Boythorn, accounting for it, mingled with the view and gave it something of a mysterious interest, in addition to its real charms\" (BH 576).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN12.json","id":"9ebf2e7f-c135-4ff0-abff-e0b1e730441e.json"},"9ec3fead-c9a5-4e14-a367-57ae740c44f8.json":{"content":"BH.IV.R1 \nchapter XI.\nAs with the prior monthly number, the right side of the Working Note for No. IV presents multiple chapters with no notations. The titles for both chapter 11 and 12 were added in ink to the corrected proofs, and Dickens appears to have returned to add the titles to the manuscript and Working Note at that stage. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN04.json","id":"9ec3fead-c9a5-4e14-a367-57ae740c44f8.json"},"9fa9135a-b99f-4319-a48e-f0bce0991c86.json":{"content":"BH.XVII.L2\nAnd Weevle?\nAlthough Weevle (aka Jobling) does not appear in No. XVII, he is mentioned in both chapters 54 and 55. In chapter 54, Mrs Snagsby mentions him as among those conspiring with her husband and \"plott[ing] against [her] peace\": \"There is Mr Weevle, friend of Mr Guppy, who lived mysteriously up a court, owing to the like coherent causes\" (BH 827). In following chapter, Guppy mentions him in his interview with Lady Dedlock in connection with her letters to Hawdon: \"However, what with the exertion of my humble abilities, and what with the help of a mutual friend by the name of Mr Tony Weevle (who is of a high aristocratic turn, and has your Ladyship's portrait always hanging up in his room), I have now reasons for an apprehension, as to which I come to put your Ladyship upon your guard\" (BH 853). While Weevle has been closely associated with the retrieval of these letters since taking up residence at Krook's following the death of Hawdon (Nemo) under the assumed name Jobling, his physical presence at Guppy's interview seems both narratively cumbersome and also something Lady Dedlock would not tolerate.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN17.json","id":"9fa9135a-b99f-4319-a48e-f0bce0991c86.json"},"a043bba7-e5c2-4dc6-bfec-c41797c01b95.json":{"content":"BH.I.R3\nOpen country house picture\nDickens's conception of Chesney Wold seems to have drawn in part on Rockingham Castle in Northamptonshire, the home of former MP Richard Watson and his wife Lavinia. Rockingham \"had always a special place in Dickens's own heart\" (Slater 322) and he had performed amatuer theatricals there in the years prior to writing Bleak House. Writing to Lavinia after completing Bleak House in August 1853, Dickens said, \"In some of the descriptions of Chesney Wold, I have taken many bits, chiefly about trees and shadows, from observations made at Rockingham. I wonder whether you have ever thought so!\" (Letters 7.135).","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN01.json","id":"a043bba7-e5c2-4dc6-bfec-c41797c01b95.json"},"a195a517-7a52-42ee-9dd8-dac3f11da972.json":{"content":"BH.XVIII.R4\nLady Dedlock has changed clothes with Jenny [...]\nDickens here works out the logistics of Lady Dedlock's efforts to elude pursuit and recognition, which determine the course of Bucket's pursuit and which culminate in their discovery of Lady Dedlock's body back in London at the end of the number. Chapter 57 makes no mention of this exchange or of the women's clothes, although Jenny's husband's account to Bucket intimates this possibility: \"Then she went–it might be at twenty minutes past eleven, and it might be at twenty minutes past twelve; we ain't got no watches here to know the time by, nor yet clocks. Where did she go? I don't know where she go'd. She went one way, and Jenny went another; one went right to Lunnun, and t'other went right from it. That's all about it\" (BH 878). In discerning that the group now possesses Lady Dedlock's watch, Bucket is confident that \"There's something kept back\" from them in the man's account, but the exchange of clothes is still beyond his speculation (BH 880).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"a195a517-7a52-42ee-9dd8-dac3f11da972.json"},"a3470081-be36-4a1c-98f9-3d0a0d398773.json":{"content":"BH.XV.R2\nDead my Lords and gentlemen\nDickens's direct indictment of political and religious leaders in the closing of chapter 47 (\"Dead, your Majesty. Dead, my lords and gentlemen. Dead, Right Reverends and Wrong Reverends of every order\") extends the novel's ongoing critique of authority (BH 734). In a letter to the surgeon William J. Clement on 20 May 1853, Dickens thanks Clement for his positive response to No. XV and comments on possible reactions from clergy: \"I have received your letter with very great pleasure. It is delightful to read such cordial words, and to be so heartily and kindly understood. I hope you will find Woodcourt's part in the end of the story, in keeping with what has pleased you so much. I think it will be pretty, and not ungraceful towards his profession. As to the opposing parsons–God help them. The world seems to me, to be on its way to leaving their ignorance a little behind\" (Letters 7.88-89). In the same letter Dickens also declines an invitation on the grounds of \"wish[ing] to finish [Bleak House] with great care, and it is almost impossible to be as secluded as one could desire (though I am very rigid in that respect), in London at this time of the year.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN15.json","id":"a3470081-be36-4a1c-98f9-3d0a0d398773.json"},"a5572e1a-7f20-4435-aeed-c0a98274e9c2.json":{"content":"BH.XIII.R1\nattorney and client.\nThe titles for all four chapters were added at proof stage, and Dickens–uncharacteristically for Bleak House–did not return to the manuscript to add the titles there. No. XIII thus offers strong evidence that Dickens returned to the Working Note to add the titles there during or following his correction of the proofs. This is further supported by the fact that Dickens came up with different titles for chapters 39 and 41. In the corrected proofs, chapter 39 was first titled (in ink) \"The Pilgrim's Progress\" before Dickens deleted it and replaced it with \"Attorney and Client.\" Similarly, chapter 41 was first titled \"Face to Face\" before Dickens settled on \"In Mr Tulkinghorn's Room.\" \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"a5572e1a-7f20-4435-aeed-c0a98274e9c2.json"},"a7676735-6fe0-430d-984e-4a7c70b5b996.json":{"content":"BH.VII.L3 \nThe Brickmaker’s family? Slightly [...]\nThe bulk of chapter 22 focuses on the introduction of Mr Bucket and Tulkinghorn's effort to track down Jo as he attempts to confirm his suspicions of Lady Dedlock. Dickens uses the trio's journey into Tom-all-Alone's to briefly re-introduce Jenny, Liz, and their brickmaker husbands. Similarly, during their journey Bucket asks Snagsby if he \"'happen[s] to know a very good sort of person of the name of Gridley'\" who is \"'keeping out of the way of a warrant I have got against him'\" (BH 357). This brief mention reminds the reader of Gridley, who last appeared in No. V, and lays the groundwork for his pursuit by Bucket in the next number.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"a7676735-6fe0-430d-984e-4a7c70b5b996.json"},"a76ef6c8-a862-408e-93a3-bbf32f4dc015.json":{"content":"BH.XIII.L2\nThe Smallweeds, in connexion with [...]\nDickens's initial memoranda sketch out the primary events for the number, which center around Tulkinghorn's disclosure of his knowledge of Lady Dedlock's secret. Yet while Tulkinghorn is the thread that runs through all four chapters in the number, the action of the number involves significant movement: it begins in London at Vholes's office and Krook's house in Chancery Lane; it then shifts to Lincolnshire and Chesney Wold, and it concludes by returning to Tulkinghorn's chambers in London. While memoranda indicate that Dickens entertained the possibility of ending with a chapter of Esther's narrative, all of this movement and action fills the entire number.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"a76ef6c8-a862-408e-93a3-bbf32f4dc015.json"},"a7ab586d-071c-4354-aac3-e058f7fd3c1d.json":{"content":"BH.VIII.R2\nmeaning, I will always live with you\nIn the manuscript, Mr Turveydrop's declaration is edited and revised, with Dickens deleting a (now illegible) phrase after \"meaning\" before arriving at this formulation: \"I will always live with you.\" \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN08.json","id":"a7ab586d-071c-4354-aac3-e058f7fd3c1d.json"},"a8c334ab-9914-4916-87d8-40c513108e50.json":{"content":"BH.XIX-XX.R7\nChapter LXV\nGiven its size, the parameters of the novel's final double number almost necessarily disrupt the organizational and spatial logic of the Working Notes. While Dickens allows at the outset for more chapter headings on the Note, the cramped spacing here might suggest that the final number sprawled into more discrete chapters than he had initially planned or envisioned.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"a8c334ab-9914-4916-87d8-40c513108e50.json"},"a9a071c0-e057-49c1-969b-40d4f893e1c6.json":{"content":"BH.XV.L1\nJo? Yes. Kill him.\nWhile the ink for these answers appears distinct from the queries and would suggest separate engagements with the Working Note, the imperative here (\"Kill him\") would indicate that at least some of these replies were made prior to or during composition. This is one of the most striking memoranda across all of the Working \nNotes, and its directness stands out even more in contrast to the other death (this one an actual murder) referenced above (\"Mr Tulkinghorn to be shot.\")\n \nIn an ambivalent review in the Athenaeum from September 1853, Henry Fothergill Chorley praised the characterization of Jo and the scene of his death in particular: \"Perhaps among all the waifs and strays, the beggars and the outcasts, in behalf of whose humanity our author has again and again appealed to a world too apt to forget their existence, he has never produced anything more rueful, more pitiable, more complete than poor Jo. The dying scene, with its terrible morals and impetuous protest, Mr Dickens has nowhere in all his works excelled. The book would live on the strength alone of that one sketch from the swarming life around us\" (Collins 279).","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN15.json","id":"a9a071c0-e057-49c1-969b-40d4f893e1c6.json"},"aa7c6fd5-84d5-4c2b-a123-28941d8fff38.json":{"content":"BH.XVIII.R3\nMr Bucket got Jo away [...]\nBucket's account to Esther about how he paid Skimpole to remove Jo from the premises of Bleak House after he had been offered temporary shelter there refers back to the episodes in No. X, chapter 31 (\"Nurse and Patient\"). In that chapter, Skimpole suggests that they \"had better turn [Jo] out\" rather than offering him shelter (BH 493). Although his suggestion is rebuffed, Jo has disappeared the next morning without explanation: \"At what time of the night he had gone, or how, or why, it seemed hopeless ever to divine. The door remaining as it had been left, and the lantern standing in the window, it could only be supposed that he had got out by a trap in the floor which communicated with an empty cart-house below. But he had shut it down again, if that were so; and it looked as if it had not been raised. Nothing of any kind was missing. On this fact being clearly ascertained, we all yielded to the painful belief that delirium had come upon him in the night, and that, allured by some imaginary object, or pursued by some imaginary horror, he had strayed away in that worse than helpless state;–all of us, that is to say, but Mr Skimploe, who repeatedly suggested, in his usual easy light style, that it had occurred to our young friend that he was not a safe inmate, having a bad kind of fever upon him; and that he had, with great natural politeness, taken himself off\" (BH 497-8).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"aa7c6fd5-84d5-4c2b-a123-28941d8fff38.json"},"aac0e19d-a63d-4cf3-8491-2787eb4bd02d.json":{"content":"BH.XIII.R5\n658 gentlemen in a bad way.\nThis is the total number of Members of Parliament in the House of Commons, which had increased to 658 following the Act of Union with Ireland in 1800.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"aac0e19d-a63d-4cf3-8491-2787eb4bd02d.json"},"ab1cb0d1-0330-4ba5-a9b2-6f8b32541c16.json":{"content":"BH.XIX-XX\nDickens began the final double number at the beginning of August while still in Boulogne. Writing to W.H. Wills in late July, he expressed a hope that \"if I can get it done in good time, that is to say by the 18th or 19th, I shall come over with it myself\" to London (Letters 7.120). By the 5th of August he reported that he was \"just getting fairly into it\" (7.124), and by the 15th he was making plans to dine with Wills at the Household Words office on the 18th, \"purposing to write the last little three-page chapter of Bleak House, in town\" (Letters 7.131). Back in Boulogne, he enjoyed a celebratory dinner on the 22nd, and in catching up on correspondence afterwards, expressed his pleasure with the conclusion before its publication at the end of the month. \"I have just finished my book (very prettily indeed, I hope),\" he wrote to Burdett Coutts on the 27th, \"and am in the first drowsy lassitude of having done so. I should be lying in the sunshine by the hour together, if there were such a thing. In its absence I prowl about in the wind and rain\" (Letters 7.132).","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"ab1cb0d1-0330-4ba5-a9b2-6f8b32541c16.json"},"ac02fbbe-1ab6-478d-a107-2cf81992c99f.json":{"content":"BH.III.L2 \nNemo? Yes\nNo. III ends with Tulkinghorn and Snagsby discovering Nemo’s corpse at his lodgings above Krook's Rag and Bottle shop. The query about Nemo's inclusion here in the memoranda for the chapter indicate that–at least in his initial planning for the chapter–Dickens was uncertain whether he (or this event) would be included in the number.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN03.json","id":"ac02fbbe-1ab6-478d-a107-2cf81992c99f.json"},"b0589916-44e0-4d60-a4ea-69428534f513.json":{"content":"BH.VII.R1 \nA New Lodger.\nThis chapter title is added in black ink to the corrected proofs; it also appears in the manuscript in black ink, where the manuscript itself is composed in blue ink, indicating that Dickens returned to the manuscript to add the title after composition. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"b0589916-44e0-4d60-a4ea-69428534f513.json"},"b0cc5217-42e0-40c6-9b3f-bb6688f4fbb3.json":{"content":"BH.I.R8\nRichard Carstone\nWhen Richard is first introduced and described by Esther in chapter 3, Dickens changes Richard's age from 17 to 19 in the galley proofs. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN01.json","id":"b0cc5217-42e0-40c6-9b3f-bb6688f4fbb3.json"},"b267855e-8f88-40a9-9e39-6a4a26a9be6f.json":{"content":"BH.XVII.L3\nSmallweeds? The Chadbands?\nThe list of characters in these memoranda indicate Dickens's clear intention to organize the number around the revelation of Lady Dedlock's past, clues to which have been distributed throughout the novel to this point. There are Guppy and Weevle who have been actively investigating that past and attempting to acquire the love letters from Krook; there is Mrs Chadband, who as Esther's childhood nurse can attest to continued existence of Lady Dedlock's child; and there are the Smallweeds, who have taken over Krook's shop and possess the material evidence of the letters between Hawdon and Lady Dedlock. Dickens's ultimate decision to include Mrs Snagsby and Grandfather Smallweed as part of the contingent who approach Bucket and Sir Leicester indicate the pressures of limited space and a desire for variety: he chooses to carry through Mrs Snagsby's conspiracies about her husband and his possible parentage of Jo rather than, for example, including a fuller scene of the Smallweed family dynamics.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN17.json","id":"b267855e-8f88-40a9-9e39-6a4a26a9be6f.json"},"b37d7beb-fa12-4a6b-82fe-261eecddb866.json":{"content":"BH.V.L5 \nMiss Flite’s friends?\nMiss Flite has appeared in Esther's narrative prior to this number (chapter 5), but only anonymously. She has only been named in chapter 11, which is narrated by the novel's third-person narrator. When Esther's visits Miss Flite in chapter 14 alongside Caddy, she discloses that hers is a \"name I now learnt for the first time\" (BH 222). \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"b37d7beb-fa12-4a6b-82fe-261eecddb866.json"},"b3f38dff-b5ae-4218-a58d-ada797a89f25.json":{"content":"BH.VI.L4\nYes. Yes. Carry through\nOne of the most interesting elements of the Working Note for No.VI is the presence of both black and blue inks, which make the different temporal layers of the note clearly legible. This change in inks also provides strong evidence for Dickens's 'retroactive' use of the working notes to record notes following composition, and even into the following month. The entirety of the manuscript up through No. VI is in black ink. At the start of No.VII, though, Dickens moves to using a blue ink in the manuscript and Working Note. This would thus suggest that these responses, as well as the notes for chapters 18 and 19, were made after composition of the number was completed, and perhaps as late as the beginning of the writing of No.VII. Throughout the composition of Bleak House, changes from black to blue ink in the manuscript and Working Notes correspond to his travels, in this instance to Dover.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"b3f38dff-b5ae-4218-a58d-ada797a89f25.json"},"b50c8d0e-c25a-4094-afc5-d5c3d6bd5d5d.json":{"content":"BH.XII.R4\nClose with that\nAt proof stage, Dickens removed some more explicit commentary from Esther on Richard's \"driving away\" with Vholes: \"We were both surprised, on our rising to accompany Richard to the little inn, that he rather objected to our going. ‘Why the fact is,’ he at length explained, with a hearty burst of laughter,–‘it’s very ridiculous, but since it must come out,–there’s nothing kept here; there was nothing to be got, but a morning-coach that happens to be waiting to be taken back; and I am going to drive Mr. Vholes over in that.’ Ada turned pale, and was quite shocked. I must say that I too felt uncomfortable, and was not relieved by the great applicability of the carriage to Mr. Vholes.\" \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN12.json","id":"b50c8d0e-c25a-4094-afc5-d5c3d6bd5d5d.json"},"b70439c1-9566-4ad5-b834-09e140225a0e.json":{"content":"BH.XIII.L3\nWind up with Esther’s Narrative?\nDickens is not only unable to return to Esther's Narrative in this number, but also stretches the number beyond the typical structure of three chapters to include a fourth chapter that depicts Tulkinghorn's return to London and his confrontation with Hortense. The monthly number begins with Esther's Narrative, and this title for chapter 43 follows the pattern where Dickens uses this generic chapter title to indicate a shift back to Esther's first-person narration to open a monthly number (this also happens in Nos. VI, VIII, X, XVI, XVIII).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"b70439c1-9566-4ad5-b834-09e140225a0e.json"},"b974d979-d868-4080-8827-ddf42f8c7c54.json":{"content":"BH.X.L1\nEsther’s Narrative\nWhile the chapter titles for chapters 31 and 32 appear to have been added to the working note after composition of the number, the appearance of this title on working note and in the manuscript indicate that Dickens had decided at very outset of planning to begin this installment with \"Esther's Narrative.\" Given that the prior number is composed entirely of third-person narration, Dickens's decision to use this generic title to indicate to himself and the reader a return to Esther's narration is unsurprising.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"b974d979-d868-4080-8827-ddf42f8c7c54.json"},"bb113f59-1fd8-4e1b-9777-dcd35cd5d567.json":{"content":"BH.XIV.R7\nBoythorn and Miss Barbary.\nThis chapter is the first time that Boythorn's engagement to Miss Barbary (Lady Dedlock's sister and Esther's aunt) is made explicit, as Jarndyce explains to Esther: \"'Then, Esther, when you spoke to me long ago of Boythorn, and when I told you that he was all but married once, and that the lady did not die, but died to him, and that that time had had its influence on his later life–did you know it all, and know who the lady was?' 'No, guardian,' I returned, fearful of the light that dimly broke upon me. 'Nor do I know yet.' 'Lady Dedlock's sister'\" (BH 685). Although it is impossible to tell whether Dickens planned this connection from the outset of the novel or whether he happened upon it as a means of tightening the plot, the former seems much more likely in this instance. After Esther first learns of Boythorn's broken engagement from Jarndyce in chapter 9, she dreams of her aunt: \"I was interested [in Boythorn's story], but not curious. I thought a little while about this old love story in the night, when I was awakened by Mr Boythorn's lusty snoring; and I tried to do that very difficult thing–imagine old people young again, and invested with the graces of youth. But I fell asleep before I had succeeded, and dreamed of the days when I lived in my godmother's house. I am not sufficiently acquainted with such subjects, to know whether it is at all remarkable that I almost always dreamed of that period of my life\" (BH 147).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"bb113f59-1fd8-4e1b-9777-dcd35cd5d567.json"},"bd04484e-c71f-4a26-a033-3ea8a94038ed.json":{"content":"BH.III.L4 \nCoavinses? No.\nAlthough Dickens decides not to include Coavinses (aka Mr Neckett) in this number, this memorandum indicates Dickens's intention to use this minor character beyond his fleeting appearance in chapter 6. References to Coavinses and his work in both chapters 9 and 10 enable Dickens to begin mapping the different social worlds of the novel. In chapter 9, Coavinses is brought up as Esther discusses the implications of her and Richard lending Skimpole money to cover his debt in chapter 6. In particular, Esther uses this event as an example of Richard's \"little acts of thoughtless expenditure\" (BH 139) that portend the future development of his character–these are the \"New traits in Richard\" mentioned in the note above. \n \nIn chapter 10, it is not Coavinses himself but rather the sheriff's officer that is mentioned twice in the third-person narration. The location of the building in Temple Bar is noted as the novel introduces Mr Snagsby and as Tulkinghorn traces \"The Law-Writer\" to Krook's: \"The Law-Stationer's establishment is, in Guster's eyes, a Temple of plenty and splendour. She believes the little drawing-room up-stairs, always kept, as one may say, with its hair in papers and its pinafor on, to be the most elegant apartment in Christendom. The view it commands of Cook's Court at one end (not to mention a squint into Cursitor Street), and of Coavins's, the sheriff's officer's backyard at the other, she regards as a prospect of unequalled beauty\" (BH 157). Indeed, Coavinses himself does not appear again the novel, although his daughter Charley becomes an important figure as she becomes Esther's attendant.","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN03.json","id":"bd04484e-c71f-4a26-a033-3ea8a94038ed.json"},"be9e8db9-75fb-41ec-957c-4c240d14a68f.json":{"content":"BH.XIX-XX.L4\nJellybys and Turveydrop’s – Deportment.\nEsther returns at some length to Caddy in the final chapter, including a brief and striking mention of Caddy's \"deaf and dumb\" \"poor little girl\" (BH 987). Only brief mention is made of Mr Turveydrop and his Deportment, but he is also linked to the Jellybys through his patronage of Peepy: \"As if I were never to have done with Caddy, I am reminded here of Peepy and old Mr. Turveydrop. Peepy is in the Custom House, and doing extremely well. Old Mr. Turveydrop, very apoplectic, still exhibits his deportment about town, still enjoys himself in the old manner, is still believed in in the old way. He is constant in his patronage of Peepy and is understood to have bequeathed him a favourite French clock in his dressing-room—which is not his property.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"be9e8db9-75fb-41ec-957c-4c240d14a68f.json"},"c0077a87-20e4-44cd-b224-490dcd0c56ed.json":{"content":"BH.VII.L4 \nMems: for future\nSince all of these events transpire in this monthly number, the \"for future\" here suggests an effort to record significant details for future reference, rather than planning specific events to include in subsequent numbers.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"c0077a87-20e4-44cd-b224-490dcd0c56ed.json"},"c04d1643-481a-4a5e-9cd8-9d5bf1b9133f.json":{"content":"BH.XIV.R9\nIn trust\nThe titles for chapters 45 and 46 were added at proof stage, and their placement and the appearance of ink on the Working Note and manuscript indicate that Dickens returned and added them to both at this later stage. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"c04d1643-481a-4a5e-9cd8-9d5bf1b9133f.json"},"c2103e62-dc57-4a1b-8bdd-b56438cba8bc.json":{"content":"BH.I.R6\nLady Dedlock’s child.\nCentral to both the narrative and structure of Bleak House is Esther’s discovery that her mother is Lady Dedlock, and Lady Dedlock’s discovery that her child is in fact alive, having been hidden and raised by her sister. The notes for No.I signal this relationship, as this lone note for Chapter 3 reads: “Esther Summerson / Lady Dedlock’s child.” The manuscript shows Dickens working to manage this relationship and its disclosure very carefully from the beginning of the novel. Dickens looks to have added to the manuscript the parenthetical description of Lady Dedlock—“(who is childless)” (BH 21)—as a revision in the opening description of her in chapter 2. The subsequent paragraphs describing the marriage between Lady Dedlock and Sir Leicester are heavily edited. Similarly, a later paragraph in chapter 3 in which Esther discusses never having heard her mother spoken of is also heavily edited in the manuscript. In the initial composition of chapter 3, Esther refers to Miss Barbary as her “aunt” from the outset, both when she is describing her memories and when she is narrating dialogue from that past (Esther pleads with her: “Oh, do pray tell me something of her. Do now, at last, dear aunt…”). This would of course imply that Esther knows Miss Barbary’s relation to her mother from her earliest days. In the manuscript, Dickens deleted all of these references to “aunt” and replaced them with the more ambiguous term “godmother.” Dickens likely makes these edits before he gets to the point later in the composition chapter when Esther learns with surprise from Kenge that Miss Barbary is her aunt (“My aunt, sir!”) (BH 33). This change is significant for the characterization of Esther’s childhood and her feelings of psychological isolation from her mother.  \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN01.json","id":"c2103e62-dc57-4a1b-8bdd-b56438cba8bc.json"},"c39d41ca-f834-4b8d-b8d4-ab7180ef6ce9.json":{"content":"BH.II.R1\nA Morning Adventure.\nAs with many of the novel’s chapter titles, there is evidence to suggest that the titles were conceived (and thus added to the Working Notes) after rather than before the initial composition of the manuscript. The verso of the second manuscript page of this number contains an aborted beginning to the chapter: Dickens writes the number heading (\"Bleak House and the East Wind\") and chapter heading (\"Chapter V\"), and then begins the number without including a title. There are a few sentences that are written, then heavily revised, and then abandoned for another beginning. At this point, Dickens scratches over this entire start, begins the number on a new sheet of paper, and flips this sheet over to use as the second page of the number. \n \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN02.json","id":"c39d41ca-f834-4b8d-b8d4-ab7180ef6ce9.json"},"c3cd6d03-39c9-4bda-afd3-d0ab02ad95ce.json":{"content":"BH.VIII.R6 \nMrs Snagsby sees it all.\nDickens formulates this chapter title in the manuscript itself. There are one or two (illegible) words deleted after \"Mrs Snagsby\" which are then followed by \"sees it all.\" The final title appears in typeset in the proofs.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN08.json","id":"c3cd6d03-39c9-4bda-afd3-d0ab02ad95ce.json"},"c42190c7-880f-4d91-9e65-c4dccc4e44ed.json":{"content":"BH.VIII.R8 \nGuster pities Jo [...]\nThis link between Guster and Jo–made explicit in this note–is drawn more subtly in the novel itself. After Jo is subjected to the harrowing sermon of Chadband, Guster offers \"her own supper of bread and cheese to hand to Jo; with whom she ventures to interchange a word or so, for the first time.\" She proceeds to inquire: \"What's gone of your father and your mother, eh?\" When Jo replies, \"I never know'd nothink about 'em,\" Guster \"cries\": \"'No more didn't I of mine'\" (BH 415-6).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN08.json","id":"c42190c7-880f-4d91-9e65-c4dccc4e44ed.json"},"c44178f5-fd5b-4aa5-a47c-357b9b0f6db0.json":{"content":"BH.XI.R5 \nNecklace and the beads\nThis note refers to one of the more enigmatic images in the number (and, indeed, the novel as a whole). Chapter 35 opens with Esther's account of her worsening illness (introduced in the middle of the prior number and suspended through the prior three chapters of third-person narration). After describing periods of hallucination and fever in which she \"knew perfectly at intervals, and I think vaguely at most times, that I was in my bed,\" Esther describes these more extreme visions: \"Dare I hint at that worse time when, strung together somewhere in great black space, there was a flaming necklace, or ring, or starry circle of some kind, of which I was one of the beads! And when my only prayer was to be taken off from the rest, and when it was such inexplicable agony and misery to be a part of the dreadful thing?\" (BH 555-6). Throughout the novel, the image of a pearl necklace is repeatedly associated with Volumnia Dedlock (Sir Leicester's cousin).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN11.json","id":"c44178f5-fd5b-4aa5-a47c-357b9b0f6db0.json"},"c5252840-cd61-4ef3-adb6-8b5eea26b2e6.json":{"content":"BH.X.R3 \nYes. Carry Allan Woodcourt through, by her\nAlthough Dickens returns to this memorandum to confirm \"Miss Flite\" in the number (the question and answer appear to have been written at different times), she does not in fact appear in it. Esther does mention her to Mrs Woodcourt at the beginning of chapter 30, which functions to \"carry through\" Allan \"by her\" as the note would indicates. In her uncomfortable conversation with Mrs. Woodcourt, Esther uses Miss Flite as means to both offer praise of Allan while obscuring or deflecting the true grounds of her admiration of him: \"I said [that Woodcourt had been at the house a great deal], and added that he seemed to be very clever in his profession–we thought–and that his kindness and gentleness to Miss Flite were above all praise\" (BH 471).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"c5252840-cd61-4ef3-adb6-8b5eea26b2e6.json"},"c5c7a6d7-e9b5-4e58-9946-86ec1d99a48b.json":{"content":"BH.VII.R5 \nThe Smallweed Family.\n​​As with the title for chapter 20, the titles for chapters 21 and 22 are added in ink in the corrected proofs. Unlike chapter 20, however, Dickens does not return to the manuscript to add them, and both chapters remain untitled in the manuscript.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"c5c7a6d7-e9b5-4e58-9946-86ec1d99a48b.json"},"c6310604-7ab8-446e-8c51-9366e255cdf3.json":{"content":"BH.XVIII.R9\nAllan Woodcourt.\nAllan appears somewhat abruptly at this final stage of the pursuit of Lady Dedlock, and Dickens offers the briefest of accounts: \"[Allan] had heard from my guardian of my having been called away on some uncommon business, and said so to dispense with any explanation\" (BH 904). \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN18.json","id":"c6310604-7ab8-446e-8c51-9366e255cdf3.json"},"c678aa49-ecf4-4f04-9bc5-360319b5eb0d.json":{"content":"BH.II.L3 \nGrandson, Watt \nThe notes show Dickens managing the relationship between Rosa and Mrs Rouncewell's grandson Watt with great care from the outset of the novel. The eventual marriage between the two is a minor, if significant thread in the novel's negotiation of class and marriage. While the initial meeting between the two in chapter 7 lays the groundwork for their romantic entanglement, Dickens manages the gradual unfolding of their relationship carefully over the ensuing numbers. ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN02.json","id":"c678aa49-ecf4-4f04-9bc5-360319b5eb0d.json"},"c715786d-1387-4582-ab2e-eaf60a5c98ca.json":{"content":"BH.VII.R6 \nPhil Squod\nPhil makes his first appearance in chapter 21, but his surname is not mentioned there and is only included with his next appearance in chapter 24.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"c715786d-1387-4582-ab2e-eaf60a5c98ca.json"},"c90c0b32-b8a7-4363-8dff-8c45e040d2bc.json":{"content":"BH.XIV.R1\nSkimpole family at home [...]\nThese notes related to Skimpole's home illustrate the complex temporal relationship between the Working Notes and the manuscript. In the manuscript, the start of the paragraph describing the location was written as: \"He lived [xxxxxxxxxxxx] Somers town,\" with the deleted words appearing to read, \"on the borders of.\" Written above the deletion, Dickens inserted–in a smaller hand and thinner pen–\"in a placed called the Polygon in.\"  Whether or not the first note here (\"borders of Somers Town\") preceded or followed the manuscript, it seems that \"Polygon\" was a later edit or revision to the manuscript, and so Dickens must have added this note at a later time. A similar temporal distance is evident in the notes involving Plymouth and Deal in chapter 45 below.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"c90c0b32-b8a7-4363-8dff-8c45e040d2bc.json"},"ca13a16d-d111-433b-ab13-28ea4ae30937.json":{"content":"BH.XVI.R8\nDisconsolate coaches\nAlthough Dickens toys with the wording of this phrase in the manuscript (writing \"carriages\" before deleting it and adding the adjective \"inconsolable\"), in the final text the carriages at Tulkinghorn's funeral are described as \"inconsolable\": \"A great crowd assembles in Lincoln's Inn Fields on the day of the funeral. Sir Leicester Dedlock attends the ceremony in person; strictly speaking, there are only three other human followers, that is to say, Lord Doodle, William Buffy, and the debilitated cousin (thrown in as a make-weight), but the amount of inconsolable carriages is immense. The peerage contributes more four-wheeled affliction than has ever been seen in that neighbourhood. Such is the assemblage of armorial bearings on coach panels that the Herald's College might be supposed to have lost its father and mother at a blow.\" (BH 804). \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"ca13a16d-d111-433b-ab13-28ea4ae30937.json"},"cb08c240-6c50-4d26-bf62-1e2b88924067.json":{"content":"BH.XV.L2\nSmallweeds? No\nAlthough the Smallweeds do not appear in No. XV, reference is made to their having taken possession of Krook's shop by way of Miss Flite in chapter 47. As Allan searches for a \"temporary place of refuge\" for the dying Jo, he seeks out Miss Flite and her altered living circumstances are described: \"But all is changed at the rag-and-bottle shop; Miss Flite no longer lodges there; it is shut up; and a hard-featured female, much obscured by dust, whose age is a problem–but who is indeed no other than the interesting Judy–is tart and spare in her replies\" (BH 720).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN15.json","id":"cb08c240-6c50-4d26-bf62-1e2b88924067.json"},"cbe27a11-58d3-44d0-847d-cdc29c4d899d.json":{"content":"BH.IX.L2 \nThe Smallweeds\nThe absence of a question mark, coupled with Dickens's characteristic underline, might suggest a clear decision to include the Smallweeds in this number (and they appear at the outset of the number).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"cbe27a11-58d3-44d0-847d-cdc29c4d899d.json"},"cf73d3cb-8981-4b0a-b98e-fd6a3d371570.json":{"content":"BH.III\nDickens was hard at work composing No. III in early March 1852 (following the publication of the novel’s first number at the beginning of the month). In addition to preparing for his upcoming theatrical tour in Birminhgam and Shrewsbury in May, Dickens and Catherine were awaiting the birth of their tenth (and last) child. Around the 9th of March Dickens wrote to Forster: \"Nothing has taken place here: but I believe, every hour, that it must next hour. Wild ideas are upon me of going to Parit–Rouen–Switzerland–somewhere–and writing the remaining two-thirds of the next No. aloft in some queer inn room\" (Letters 6.623). Catherine gave birth to their seventh son, whom they named Edward Bulwer Lytton Dickens, on March 13th, with Dickens calling him \"a brilliant boy of unheard-of dimensions\" (Letters 6.624). Dickens was still composing No. III later in March, writing Lavinia Watson on the 22nd: \"I have been writing all day, and, if I were to write more here, should go on for I can't foresee how many pages. I had better go out, instead, and have a long walk–for both our sakes\" (Letters 6. 630).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN03.json","id":"cf73d3cb-8981-4b0a-b98e-fd6a3d371570.json"},"cfd7545a-d18b-47fd-ba6d-80afb51a6520.json":{"content":"BH.X.R1 \nCharley’s Illness Dawn of Esther’s?\nNo. X brings Bleak House to its mid-way point, and it culminates with two major, if distinct events in the plot: the onset of Esther's illness and Krook's death by spontaneous combustion. Anticipating the memoranda for chapter 31 on the other side of the Note, the memoranda outline the causal chain of Esther's illness. Of particular interest here is the decision-making around whether to include the \"dawn\" of Esther's illness in this number, or to hold it over for No. XI. Dickens does, of course, include the onset of the illness with Esther going blind at the very end of chapter 31, generating suspense regarding the exact course that her illness will subsequently take. This suspense is amplified by Krook's death that ends the number, where the cause is announced but whose implications are left unspecified. Dickens begins the subsequent number with the inquest and fallout of Krook's death, holding off a return to Esther and her illness until chapter 35.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"cfd7545a-d18b-47fd-ba6d-80afb51a6520.json"},"d1d84007-0644-4692-84c6-628627a8a281.json":{"content":"BH.XV.R5\nMaking things pleasant\nThese notes refer to Bucket's explanation of his actions following his arrest of George after departing the Bagnets and the celebration of Mrs Bagnet's birthday: \"‘Now, George,’ continues Mr. Bucket, putting his hat upon the table with an air of business rather in the upholstery way than otherwise, ‘my wish is, as it has been all the evening, to make things pleasant. I tell you plainly there's a reward out, of a hundred guineas, offered by Sir Leicester Dedlock, Baronet. You and me have always been pleasant together; but I have got a duty to discharge; and if that hundred guineas is to be made, it may as well be made by me as any other man. On all of which accounts, I should hope it was clear to you that I must have you, and that I'm damned if I don't have you. Am I to call in any assistance, or is the trick done?’\" (BH 766).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN15.json","id":"d1d84007-0644-4692-84c6-628627a8a281.json"},"d240eeb4-966b-4e13-a7d1-580067c2e6dd.json":{"content":"BH.XIV.R2\nBeauty Daughter, Sentiment daughter, Comedy Daughter\nWhile the names of Skimpole's daughters are  Arethusa, Laura, and Kitty (respectively) in the published text, in the manuscript they appear as Juliet, Laura, and Susannah. Interestingly, these same names appear in the corrected proofs which have been retained, which indicates that there was likely another, later iteration of corrected proofs where Dickens made these changes.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"d240eeb4-966b-4e13-a7d1-580067c2e6dd.json"},"d251051e-2f7b-47dd-8e14-afb62315a384.json":{"content":"BH.XIV.R6\n“Guardian, Lady Dedlock is my mother.\nIn the final published text, Esther does not directly state that \"Lady Dedlock is my mother.” Instead, Esther only articulates this connection at a remove via Miss Barbary: \"'Yes, guardian, yes! And her sister is my mother!\" (BH 686). In the manuscript, Dickens appears to have started to write this phrase that appears on the Working Note before altering it: \"And [Lady De] her sister is my mother.\"","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"d251051e-2f7b-47dd-8e14-afb62315a384.json"},"d303eaad-af81-4027-b891-38aa7d2b358f.json":{"content":"BH.V.L6 \n“I have forgotten to mention again [...]”\nThe placement of these two memoranda at the bottom of the working note, along with their actual content, suggests that they might have been recorded during or after composition (rather than preceding composition of chapter 14). This final note refers to the conclusion of chapter 14, where Esther–in a tellingly evasive manner–discloses her growing acquaintance with Woodcourt. Given his careful handling of the disclosure of Esther's romantic entanglement with Woodcourt over the course of the novel, this note is significant in the way that it captures the texture of her evasiveness. The text is slightly different in the manuscript and final text: \"I have forgotten to mention–at least I have not mentioned–\" (BH 237). \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"d303eaad-af81-4027-b891-38aa7d2b358f.json"},"d4f542d1-0f74-41b3-8e81-b7e0ca19116a.json":{"content":"BH.XV.R1\n“If it could be written [...]\nThese memoranda make explicit that \"Jo's Will\" is an effort to record his apology for infecting Esther. The particular wording of the note here deviates from Jo's various utterances of this phrase to Mr. Snagsby in his effort to record his apology: \"'I'm wery sorry that I done it, but I didn't go fur to do it, sir'\" (BH 730); \"'Wot I wos a thinkin on then, Mr Sangsby, wos, that wen I was moved on as fur as ever I could go and couldn't be moved no furder, whether you might be so good p'raps, as to write out, wery large so that any one could see it anywheres, as that I wos wery truly hearty sorry that I done it and that I never went fur to do it; and that though I didn't know nothink at all, I knowd as Mr Woodcot once cried over it and wos allus grieved over it, and that I hoped as he'd be able to forgiv me in his mind. If the writin could be made to say it wery large, he might'\" (BH 731). \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN15.json","id":"d4f542d1-0f74-41b3-8e81-b7e0ca19116a.json"},"d516adfb-e435-46b8-86b4-c565e6254029.json":{"content":"BH.XVI.R4\nEnlightened\nThe title for chapter 51 appears to have been added to the manuscript following the initial composition of the chapter, and looks to have first been given a different title. Dickens begins the chapter immediately below the chapter heading, and the chapter title (uncharacteristically) appears to the side of the chapter heading. On the left side is a shorter, one-word title that is deleted and illegible. To the right of the chapter heading \"Enlightened\" appears. The chapter title appears in type in the corrected proofs, so it is not clear at what point Dickens added the title to the chapter. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"d516adfb-e435-46b8-86b4-c565e6254029.json"},"d62a8e21-3ac5-4f1a-a6b9-3a498e693701.json":{"content":"BH.VIII.R7 \nLet all concerned in any secresy, Beware!\nAlthough the wording of this phrase closely matches the final printed text, this particular formulation only appears at proof stage. In the manuscript, this sentence reads: \"And into whatsoever atmosphere of secrecy his own shadow may pass, let all concerned beware, for the watchful Mrs Snagsby is there too–bone of his bone, flesh of his flesh, shadow of his shadow.\" In the corrected proofs, Dickens inserts the phrase \"in the secrecy\" after “let all concerned,” and splits this into two sentences by adding the exclamation point, so that the final text reads: \"And into whatsoever atmosphere of secrecy his own shadow may pass, let all concerned in the secrecy beware! For the watchful Mrs Snagsby is there too–bone of his bone, flesh of his flesh, shadow of his shadow\" (BH 416).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN08.json","id":"d62a8e21-3ac5-4f1a-a6b9-3a498e693701.json"},"d7a31cb5-63f5-42d0-9351-bb66d2222de6.json":{"content":"BH.XVI.R2\nWork in Woodcourt\nThe sequence of these notes for chapter 50 suggest that Dickens first settled on Caddy's illness as the framework for the chapter and then decided to use it as an opportunity to \"work in Woodcourt\" (rather than, for example, having the primary intent being the return of Woodcourt, and simply using Caddy's illness as a mechanism for bringing that about). Caddy's illness does not seem to have particular significance on its own, although it does provide another opportunity for the display of Esther's constancy, as well as for the brief returns of Mr Turveydrop and the Jellybys. On the 20th of June (after the completion of this number), Dickens wrote to W.J. Clement: \"I hope you will find Woodcourt's part in the end of the story, in keeping with what has pleased you so much. I think it will be pretty, and not ungraceful towards his profession\" (Letters 7.89).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"d7a31cb5-63f5-42d0-9351-bb66d2222de6.json"},"d92be0a8-d1f7-45cb-8e40-bcebc1cd26ad.json":{"content":"BH.VII.R7 \nDetective officer\nThe detective branch of the Metropolitan Police was established in 1842. The July 13, 1850 issue of Household Words described this new type of officer in an article called \"The Modern Science of Thief-Taking,\" attributed to W.H. Wills but co-written by Dickens: “If an urchin picks your pocket, or a bungling ‘artist’ steals your watch so that you find it out in an instant, it is easy enough for any private in any of the seventeen divisions of London Police to obey your panting demand to ‘Stop thief!’  But the tricks and contrivances of those who wheedle money out of your pocket rather than steal it; who cheat you with your eyes open; who clear every vestige of plate out of your pantry while your servant is on the stairs; who set up imposing warehouses, and ease respectable firms of large parcels of goods; who steal the acceptances of needy or dissipated young men;—for the detection and punishment of such imposters a superior order of police is requisite. To each division of the Force is attached two officers, who are denominated ‘detectives.” (Household Words vol.1, no. 16)\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"d92be0a8-d1f7-45cb-8e40-bcebc1cd26ad.json"},"dad76a1e-1a1e-41b7-a812-1c79e9812564.json":{"content":"BH.XI.R1 \nKrook Mrs Smallweed’s brother.\nThe revelation that Mrs Smallweed is in fact Krook's brother is another instance where Dickens uses suppressed familial relationships to create connections and tighten character networks as the novel progresses. Another important example of this is the revelation of Mrs Chadband as Mistress Rachel from Esther's childhood.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN11.json","id":"dad76a1e-1a1e-41b7-a812-1c79e9812564.json"},"db0e178d-027d-425a-bdac-eb3d2b26424a.json":{"content":"BH.XVI.R3\n“Still the same shadow on my darling”\nThe wording of the final sentence of the chapter differs from the memorandum here. The final text reads: \"But I lay down, self-deceived, in that belief. And I awoke in it the next day, to find that there was still the same shade between me and my darling\" (BH 778). Dickens reworked this phrase several times in the manuscript and corrected proofs. Dickens seems to have originally composed the last phrase as \"there was still that same shade between me and my darling.\" The phrase \"shade between me and\" is struck out and edited to \"shadow on.\" This formulation–which matches the memorandum here–is itself then struck out and Dickens reverts to \"shade between me and my darling.\" In the corrected proofs \"that same shade\" is altered to \"the same shade.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN16.json","id":"db0e178d-027d-425a-bdac-eb3d2b26424a.json"},"db57d2a9-a2e5-402e-ab73-155922f43e8d.json":{"content":"BH.IV.R2 \n[non-textual marking]\nThis non-textual marking does not appear to signify anything specific, but the line links this space in chapter 11 to the memoranda related to the \"Coroner's Inquest\" on the left-hand side of the note. This is the only instance in Bleak House–and one of the few across all of the working notes–where Dickens directly links memoranda with chapter notes in this way. ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN04.json","id":"db57d2a9-a2e5-402e-ab73-155922f43e8d.json"},"dc9bf9f8-5d2e-4ae4-bc08-ff9cd99ec6bf.json":{"content":"BH.IX\nThe manuscript for No. IX, like the two preceding numbers, is composed entirely in blue ink. In the following monthly number, Dickens returns to the use of black ink. This would suggest (alongside evidence provided by the chapter titles) that these notes on the right side of the Working Note are made following the composition and completion of No. IX, possibly after his return to London.\n \nAt the beginning of October 1852, Dickens and his family left their rented lodgings in Dover and repaired to Boulogne, where Dickens composed No. IX. On October 4, Dickens wrote to Burdett Coutts from Boulogne: \"I am going to work tomorrow morning, and purpose remaining here while I write the next No. of Bleak House. It will probably take me until this day fortnight. As soon as I have done I shall return home–the children have already gone home\" (Letters 6.770-71). In a letter to W.H. Wills the following day regarding matters related to Household Words, he included a short note: \"BLEAK HOUSE. Just begun\" (Letters 6.773) and on the 11th of October he sent the first 16 manuscript pages (chapters 26 & 27) to Bradbury and Evans. By the 18th of October, Dickens had returned to London. [see note below on Mrs Smallweed and Judy]","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"dc9bf9f8-5d2e-4ae4-bc08-ff9cd99ec6bf.json"},"de3cad9c-60c1-4e34-90b4-47a3a49abbc6.json":{"content":"BH.X.L4 \n“Spontaneous Combustion and no other death.”\nIn the manuscript, the wording of this final phrase of the number closely follows the formulation of this note: \"Spontaneous Combustion, and no other death of all the deaths that can be died.\" In the corrected proofs, Dickens alters this clause so that in the printed text it appears as: \"Spontaneous Combustion, and none other of all the deaths that can be died.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"de3cad9c-60c1-4e34-90b4-47a3a49abbc6.json"},"de41041b-985d-4c64-b44e-227de86358d7.json":{"content":"BH.XIX-XX.R4\nMr Skimpole. Life afterwards written\nThese notes for the chapter document the two significant events of the chapter: Esther's final encounter with Skimpole and her narration of \"what I know of his history\" (BH 935), and Woodcourt's declaration of his love for Esther. The transition between these two events occurs abruptly in the chapter itself. Esther shares a brief excerpt from Skimpole's published \"Life\" in which he refers to Jarndyce as \"the Incarnation of Selfishness\" and then continues: \"And now I come to a part of my story, touching myself very nearly indeed, and for which I was quite unprepared when the circumstance occurred\" (BH 935).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"de41041b-985d-4c64-b44e-227de86358d7.json"},"deb3d522-d30b-4219-bb47-8b8b2182193f.json":{"content":"BH.XI.R7 \n“And now I must tell the little secret.”\nThe sentence containing Esther's disclosure of her sense of Woodcourt's love for her at the end of this chapter is heavily revised in the manuscript. The eventual wording Dickens settles upon–\"And now I must part with the little secret I have thus far tried to keep\"–is different from the wording in this note.\n \nIn a playful and rambling letter to Mary Boyle, dated Christmas day 1852, Dickens wrote: \"O Mary wen [sic] you come to read the last chapter of the next number of Bleak House I think my ever dear as you will say as him what we knows on as done a pretty womanly thing as the sex will like and as will make a sweet pint [sic] for to turn the story on my heart alive for such as you are\" (Letters 6.836).","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN11.json","id":"deb3d522-d30b-4219-bb47-8b8b2182193f.json"},"e19d45ad-2697-4ac7-ab8a-a47d27389cc8.json":{"content":"BH.XIII.L4\nNo – French woman. Lay that ground.\nAlthough the specifics of this \"ground\" Dickens that wishes to lay with Hortense in the number's final chapter are not made clear, this memorandum offers an early indication of Dickens's intentions regarding the murder of Tulkinghorn.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN13.json","id":"e19d45ad-2697-4ac7-ab8a-a47d27389cc8.json"},"e1b102c5-ef09-49cb-883a-77b9395a2974.json":{"content":"BH.XI.R2 \nLady Dedlock – the young man – and the old man.\nThe end of chapter 33 shows Guppy, the \"young man,\" calling upon Lady Dedlock to inform her that he has failed to obtain Hawdon's letters (and that they have indeed been destroyed). Tulkinghorn, the \"old man,\" arrives at the end of their brief conversation: \"But in that house, in that same moment, there happens to be an old man of the name of Tulkinghorn. And that old man, coming with his quiet footstep to the library, has his hand at that moment on the hand of the door–comes in–and comes face to face with the young as he is leaving the room. One glance between the old man and the lady; and for an instant the blind that is always down flies up. Suspicion, eager and sharp, looks out Another instant; close again\" (BH 536). While the descriptors create a clear juxtaposition between Guppy and Tulkinghorn in this scene, this is the first time in the novel that Tulkinghorn has been referred to as \"the old man.\" Interestingly, prior to this moment that phrase has only been used to describe Krook and Mr Smallweed, two characters who become more entangled in Tulkinghorn's machinations. ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN11.json","id":"e1b102c5-ef09-49cb-883a-77b9395a2974.json"},"e32f024a-29b9-49fc-9935-048b6d03f5cf.json":{"content":"BH.X.R2 \nKrook’s death.\nThe scientific plausibility of Krook’s death by Spontaneous Combustion was publicly debated following the publication of No. X of Bleak House. Most notably, George Henry Lewes criticized Dickens in an article in The Leader on December 11, 1852. While Dickens gathered more sources to bolster its plausibility through the coroner’s inquest in the following installment, Lewes published two more rebuttals in February, and he and Dickens continued to debate the matter in a private exchange of letters (see the Introduction to The Working Notes for Bleak House). Dickens revisited the issue and maintained his position in the novel’s Preface (written in August 1853 at the conclusion of the novel’s serial run): “There is only one other point on which I offer a word of remark. The possibility of what is called spontaneous combustion has been denied since the death of Mr. Krook; and my good friend Mr. Lewes (quite mistaken, as he soon found, in supposing the thing to have been abandoned by all authorities) published some ingenious letters to me at the time when that event was chronicled, arguing that spontaneous combustion could not possibly be. I have no need to observe that I do not wilfully or negligently mislead my readers and that before I wrote that description I took pains to investigate the subject. There are about thirty cases on record, of which the most famous, that of the Countess Cornelia de Baudi Cesenate, was minutely investigated and described by Giuseppe Bianchini, a prebendary of Verona, otherwise distinguished in letters, who published an account of it at Verona in 1731, which he afterwards republished at Rome. The appearances, beyond all rational doubt, observed in that case are the appearances observed in Mr. Krook's case. The next most famous instance happened at Rheims six years earlier, and the historian in that case is Le Cat, one of the most renowned surgeons produced by France. The subject was a woman, whose husband was ignorantly convicted of having murdered her; but on solemn appeal to a higher court, he was acquitted because it was shown upon the evidence that she had died the death of which this name of spontaneous combustion is given. I do not think it necessary to add to these notable facts, and that general reference to the authorities which will be found at page 30, vol. Ii., the recorded opinions and experiences of distinguished medical professors, French, English, and Scotch, in more modern days, contenting myself with observing that I shall not abandon the facts until there shall have been a considerable spontaneous combustion of the testimony on which human occurrences are usually received” (BH 6-7).","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"e32f024a-29b9-49fc-9935-048b6d03f5cf.json"},"e3e25bba-2980-4435-bd11-e230dda65264.json":{"content":"BH.VI.R6 \nMr and Mrs Chadband (Mistress Rachael).\nBy the end of chapter 19, the dual identity of Mrs Chadband as \"Mistress Rachael\" (the former servant at Miss Barbary's) is made explicit, as she discloses to Guppy that \"I was left in charge of a child named Esther Summerson, who was put out in life by Messrs Kenge and Carboy\" (BH 312). However, in the initial composition of the chapter, the first introduction of Mrs Chadband includes the hint \"of whom the eye or ear of this history seems to have some previous knowledge.\" Dickens deletes this phrase in the corrected proofs.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"e3e25bba-2980-4435-bd11-e230dda65264.json"},"e787a216-9cad-4fa4-a628-e083ffb26321.json":{"content":"BH.XIX-XX.R3\n“That he may not live [...]\nThis phrase, spoken by Ada to conclude chapter 60, appears in the manuscript, although Dickens tries and deletes several different formulations. The phrase \"to do so much\" is visible several times in these deleted formulations. The final version of this sentence in the manuscript reads: \"That he may not live to see the child–the child who is to do so much!\" At proof stage, however, Dickens deletes this final clause, and the final printed text simply reads: \"That he may not live to see his child\" (BH 929). This would seem to suggest that this note was added during or just after the composition of the chapter, and before the proof stage. While Esther dwells on Ada and Richard's son in the novel's final chapter, and while this final clause is in keeping with the redemptive trajectory of the events following the conclusion of the novel, it is not clear what, specifically, the child is \"to do.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"e787a216-9cad-4fa4-a628-e083ffb26321.json"},"e83275ee-c49e-44c7-9540-79836b3ffd8b.json":{"content":"BH.V.L3 \nAllan Woodcourt.\nWoodcourt first appears in the previous monthly number, first when he attends the discovery of Nemo's body; he is then mentioned at the very end of chapter 13 as a \"gentleman of a dark complexion–a young surgeon\" (BH 214) as Esther and the others dine at the Badgers's. However, he is not named in either appearance. Although Dickens contemplates various names in the Working Note here, only his surname is provided in No. V.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN05.json","id":"e83275ee-c49e-44c7-9540-79836b3ffd8b.json"},"e83b49dd-9249-489f-9d03-105a5ee9e7e2.json":{"content":"BH.XVII.R2\nBucket & Sir Leicester.\n​​In Bucket's slow disclosure of the chain of events and circumstances surrounding Lady Dedlock's relationship with Hawdon and the murder of Tulkinghorn, he refers back to their discussion in the previous chapter (ch. 53) by explaining: \"Sir Leicester Dedlock, Baronet, I did endeavour to pave the way a little towards these unpleasant disclosures, yesterday, by saying that very strange things happened even in high families sometimes. All this, and more, has happened in your own family, and to and through your own Lady\" (BH 820-821). Interestingly, Dickens himself begins to use this phrase \"pave the way\" as a common instruction within his memoranda in the working notes, beginning in Little Dorrit, the next monthly serialized novel after Bleak House.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN17.json","id":"e83b49dd-9249-489f-9d03-105a5ee9e7e2.json"},"ea1e5f14-ed27-4266-955b-1dc95949d8e2.json":{"content":"BH.VIII.R1 \nFrench maid\nThe first chapter of No. VIII is a fairly eclectic chapter, which follows the group's return to London after their visit to Boythorn. The notes here offer a fairly straightforward catalogue of the chapter's main events. While they highlight the wide range of characters who populate the chapter–Hortense, Richard, the Jellybys and Turveydrops, Charley–the chapter as whole draws out these character's increasing reliance on Esther and her judgment. The structure of the chapter itself foregrounds this importance, as it opens with Hortense offering herself as Esther's maid (which Esther rejects by saying, \"I assure you [...] that I keep no maid”) (BH 368) and closes with Esther accepting Charley into service as a \"present to [her], with Mr Jarndyce's love\" (BH 385).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN08.json","id":"ea1e5f14-ed27-4266-955b-1dc95949d8e2.json"},"eb31b2ab-4ae7-4ea7-9672-655759851055.json":{"content":"BH.IV.L3 \nRosa & Watt? Yes. Slightly.\nSimilar to the previous monthly number, Dickens includes a memorandum related to the romantic relationships that will structure the novel's plot. As with Richard and Ada, the \"slightly\" here seems to refer more to the amount of text devoted to the burgeoning romance between Rosa and Watt than to its explicitness. This courtship contributes significantly to the novel's exploration of the tensions between aristocratic and industrial classes, and has significant echoes with Lady Dedlock's romance with Hawdon, which are apparent already in this chapter. Although the eventual union of Rosa and Watt will not come to fruition until very late in the novel, Dickens lays the groundwork for it and does work to \"carry on\" the thread in many of the early numbers.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN04.json","id":"eb31b2ab-4ae7-4ea7-9672-655759851055.json"},"eb501c4e-486b-4a8a-87dd-ed2a2ed8243b.json":{"content":"BH.XIV.L1\nMr and Mrs Chadband? No \nDickens's memoranda for Number XIV show him contemplating a range of character combinations for the number. The fact that the appearances of the Chadbands, Boythorn, George and the Bagnets must all be deferred indicates some of the pressure on the plot as the novel enters its later stages. The consideration of the Chadbands here is possibly related to the unraveling of the connections between Boythorn, Miss Barbary, Lady Dedlock and Esther. Mrs Chadband (Rachael) had been revealed as Esther's childhood nurse in chapter 19, thus providing one possible avenue for uncovering some of these connections. Dickens again contemplates and defers the return of the Chadbands in the following number, and they finally return in No. XVII (chapter 54).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"eb501c4e-486b-4a8a-87dd-ed2a2ed8243b.json"},"ec979629-e1ed-45cb-b5f0-ccac6ab6ccff.json":{"content":"BH.I.R2 \nIn [the fashionable world] fashionThis is the only chapter title in the Working Notes of Bleak House that has been edited or altered.  Here and in the manuscript the chapter is initially titled \"In the Fashionable World,\" before Dickens alters it to “In Fashion.” While there are frequent edits to chapter titles in the manuscript and galley proofs, all of the chapter titles in the Working Notes match their published final form. The evidence provided by the manuscript and proofs suggests that Dickens generally added these chapter titles to the Working Notes during or after the proof stage of each monthly number. ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN01.json","id":"ec979629-e1ed-45cb-b5f0-ccac6ab6ccff.json"},"ede90e15-c837-44b5-9ca2-a0a4aba19f5e.json":{"content":"BH.VI.R3 \nLady Dedlock & Esther. \nWith Esther's first meeting with Lady Dedlock in this chapter, Dickens must carefully handle Esther both women's gradual recognition of their relationship, as well as the reader's discovery of this connection. Throughout the chapter Esther is visibly struck by the appearance of Lady Dedlock's face, such as when she sees her in the \"little church\" mentioned in the accompanying note (\"But why her face should be, in a confused way, like a broken glass to me [...] I could not think\") (BH 292). At the same time, though, Dickens makes efforts to obscure information that might make the connection too explicit. For instance, in the corrected proofs Dickens deleted part of the conversation between Lady Dedlock and Jarndyce where they discuss the latter's acquaintance with her sister. After Lady Dedlock speaks of the two having \"[gone] our several ways [...] ha[ving] little in common even before we agreed to differ\" (BH 298), the following short exchange is removed:\n \n\"'Did you know her afterwards?'\nHe shook his head.\n'You never met her?'\n'Never.'\n'You are, of course, aware that she is dead?'\n'Yes,' he said, 'I heard of it some time ago. She lived so retired, that I heard of it by mere accident.'\"\n \nWhile Lady Dedlock's knowledge of her sister's death might raise questions about how she could remain ignorant of Esther's existence, the mention of her death and \"retired\" life might make the correspondence to Esther's circumstances too obvious.\n \nSimilarly, when Esther first sees Lady Dedlock in this chapter, she ponders whether her \"face accidentally resemble[d] my godmother's\" (BH 292). As noted in the annotations to No. I, Esther refers to Miss Barbary as her \"godmother\" at the outset of her narration even though she eventually learns that Miss Barbary is in fact her aunt. When Esther first sees Lady Dedlock, she is aware that Miss Barbary is her aunt, so her reversion to this label is curious.","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"ede90e15-c837-44b5-9ca2-a0a4aba19f5e.json"},"ef33d0b3-0a84-4625-b4cb-1e67f1349aaf.json":{"content":"BH.X.L2 \nJO–begin the illness from him.\nThe chapter notes for chapters 30 and 32 are consistent with Dickens's habit through this section of Bleak House of using these chapter memoranda primarily to record sequences of events within chapters. In contrast, the imperative nature of this note functions in a different register. \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN10.json","id":"ef33d0b3-0a84-4625-b4cb-1e67f1349aaf.json"},"f05626a0-5b78-4948-8aae-ddad09cd9b00.json":{"content":"BH.XV.R4\nHigh and mighty street.\nThe memoranda for chapter 48 offer a fairly straightforward summary of the main sequence of events in the chapter, culminating in the murder of Tulkinghorn in his chambers. While the phrase \"Don't go home!\" first appears in reference to the \"splendid clock\" in the Dedlock house, the phrase is repeated as Tulkinghorn travels from their \"house in town\" (referenced in the left-hand memoranda) to his lodgings, but the \"high and mighty street\" referenced here is not described as such in the text itself: \"He passes out into the streets, and walks on, with his hands behind him, under the shadow of the lofty houses, many of whose mysteries, difficulties, mortgages, delicate affairs of all kinds, are treasured up within his old black satin waistcoat. He is in the confidence of the very bricks and mortar. The high chimney-stacks telegraph family secrets to him. Yet there is not a voice in a mile of them to whisper 'Don't go home!'\" (BH 747).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN15.json","id":"f05626a0-5b78-4948-8aae-ddad09cd9b00.json"},"f112dc4d-b202-46f6-aaf9-c886728cb9e2.json":{"content":"BH.IX.R2 \nVisitors – Mr Smallweed and Judy \nDickens's absence from London during the composition of No. IX resulted in an error that required the plate for chapter 26 to be canceled. Dickens sent the manuscript for chapters 26 and 27 to Bradbury and Evans on the 11th of October, with the note: \"You can send me the proof here, by parcel direct. As I expect to be home next Monday [Oct. 18th], I shall probably bring the remainder [i.e., chapters 28 and 29] with me instead of sending it\" (Letters 6.776). In his illustration for chapter 26, Hablot K. Browne had mistakenly included a member of the Smallweeds who is not present in their visit to the Shooting Gallery, and with Dickens not returning to London until the 18th, there was not time to supply a substitute plate before printing. A revised plate was included as a third illustration in the next monthly number (Letters 6.776fn1).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"f112dc4d-b202-46f6-aaf9-c886728cb9e2.json"},"f1344019-bae0-418b-a73c-284ceb6b1d4b.json":{"content":"BH.XVII.L1\nYes. No Grandfather. Yes.\nThe questions appear in a thinner, lighter nib while all of the replies appear in a thicker and darker nib. The questions have a similar appearance to the chapter headings and titles for chapters 54 and 55, while the replies appear similar to the chapter notes for chapters 54 and 55. The chapter title and notes for chapter 56 appear more similar to the thicker nib in the replies but could be the product of a distinct engagement with the working note.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN17.json","id":"f1344019-bae0-418b-a73c-284ceb6b1d4b.json"},"f171ba6d-518a-4c38-9cd1-edaa50521974.json":{"content":"BH.XIV\nDickens composed most of No. XIV while in Brighton for a fortnight at the beginning of March 1853. On the 4th of March he wrote to Burdett Coutts from Brighton: \"It is beautifully fine and bright here, though very cold out of the sun. The weather, wonderfully propitious for walking, but hardly so for authorship as I have not yet made what can be called a beginning\" (Letters 7.41). The following day, he wrote again saying that \"it is pouring of rain–is very misty–and is blowing\" and: \"I have the rheumatism in my back, and was seized in the night [...] with my old horrid nervous choaking [sic]\" (Letters 7.42). On Sunday the 13th of March, he wrote again to Coutts: \"I shall be in town tomorrow night or Tuesday, and will present myself in Stratton Street as soon as Bleak House is shut up for the month–which I hope will be before the week\" (Letters 7.50). No letters survive from Monday or Tuesday, but Dickens had returned to Tavistock House by Wednesday the 16th so presumably finished the number upon returning to London.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN14.json","id":"f171ba6d-518a-4c38-9cd1-edaa50521974.json"},"f2e9fe57-62df-4418-bf05-382c3d629802.json":{"content":"BH.VI.R2 \n“Why, rather like” my dear\nIn the same way that the phrase \"my dear\" appears added at the end of this quotation in the note, the phrase appears to be an addition in the manuscript as well. Dickens originally ends the chapter with Ada saying, \"O very like it indeed!\" However, he returns and–in what appears to be a different, lighter ink–deletes the exclamation point and quotation marks and adds \"my dear!'\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"f2e9fe57-62df-4418-bf05-382c3d629802.json"},"f3f42d36-c4bc-4db9-a1c2-b1897cd75c1e.json":{"content":"BH.XV.L3\nSnagsbys? Mr Slightly\nAs he decides on whether to include the death of Jo in this number, Dickens also considers the various characters most closely associated with Jo–here, that is both the Snagsbys and the Chadbands (along with Allan Woodcourt above). Mr Snagsby is present alongside Woodcourt, George Rouncewell, and Phil Squod at Jo's death, and is the recipient of \"Jo's will.” The modifier \"slightly\" might refer to the fairly passive role he plays in the chapter.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN15.json","id":"f3f42d36-c4bc-4db9-a1c2-b1897cd75c1e.json"},"f44bac58-9393-4e8e-8170-2ae86db5fc06.json":{"content":"BH.XII.R7 \nMr Guppy’s contention [...]\nChapter 38 closes with Guppy's inward and outward \"struggle\" upon seeing Esther following her illness and his subsequent wish to obtain, to the satisfaction of his legalistic mind, confirmation that any possibility of romantic connection between them has ceased. This peculiar idea of \"legal and illegal Angels\" does not appear in the chapter itself.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN12.json","id":"f44bac58-9393-4e8e-8170-2ae86db5fc06.json"},"f5bc27ad-69e9-4784-aafe-62cb4f07e1e4.json":{"content":"BH.VIII.R4 \nEngagement off.\nChapter 24 extends Richard's \"Downward Progress\" from the prior chapter; before departing for the army, Jarndyce recommends–given the state of Richard's position and prospects–that his engagement with Ada be broken off. While Richard agrees to the decision, he loses trust in Jarndyce. In pairing Richard's downward progress with the demise of Gridley in this chapter, Dickens heightens the sense of foreboding that accompanies Richard's inability to disentangle his future prospects from the resolution of Jarndyce & Jarndyce. While the bulk of the chapter details the tangible effects of Chancery on those drawn into its operations, the transition from Richard to Gridley is accomplished by Esther's visit to the court to witness its proceedings, which elicits her incredulous rebuke: \"To see everything going on so smoothly and to think of the roughness of the suitors' lives and deaths; to see all that full dress and ceremony and to think of the waste, and want, and beggared misery it represented; to consider that while the sickness of hope deferred was raging in so many hearts this polite show went calmly on from day to day, and year to year, in such good order and composure; to behold the Lord Chancellor and the whole array of practitioners under him looking at one another and at the spectators as if nobody had ever heard that all over England the name in which they were assembled was a bitter jest, was held in universal horror, contempt, and indignation, was known for something so flagrant and bad that little short of a miracle could bring any good out of it to any one—this was so curious and self-contradictory to me, who had no experience of it, that it was at first incredible, and I could not comprehend it. I sat where Richard put me, and tried to listen, and looked about me; but there seemed to be no reality in the whole scene except poor little Miss Flite, the madwoman, standing on a bench and nodding at it\" (BH 396-7).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN08.json","id":"f5bc27ad-69e9-4784-aafe-62cb4f07e1e4.json"},"f8dea9c2-36eb-4e89-8c1e-77280a0f553b.json":{"content":"BH.XIX-XX.L5\nChesney Wold Picture.\nDickens's characterisation of this closing \"Picture\" of Chesney Wold carries through language he has used elsewhere in the notes to describe depictions of the estate. The memoranda for No. I (chapter 2)  include an \"open country house picture.\" And the previous number includes notes for both a \"Night Picture\" of Chesney Wold in chapter 58, as well as an \"Inn Picture\" as part of Esther and Bucket's pursuit of Lady Dedlock. Dickens appears to have already had this closing image of the Mausoleum in mind in late June, as he wrote to Hablot K. Browne on the 29th of June saying he was \"now ready with four subjects for the concluding double No.\" (Letters 7.107).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN19.json","id":"f8dea9c2-36eb-4e89-8c1e-77280a0f553b.json"},"f98342be-d595-4363-8a15-080a28e64a72.json":{"content":"BH.XI.R3 \nThe Bagnets.\nThe corrected proofs that have been retained for chapters 33 and 34 are a second set, and contain very minimal edits. However, at this late stage Dickens decided to change Matthew Bagnet's \"old regimental nickname\" (BH 540) from \"Number Seventy-Four\" to \"Lignum Vitae.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN11.json","id":"f98342be-d595-4363-8a15-080a28e64a72.json"},"f9876ff3-3de2-45e5-81d0-ed4e34a40f42.json":{"content":"BH.I.R5\n[circular ink spot]\nThis large circular ink splotch in the middle of the Note does not appear to have any particular significance, and it is unclear whether it comes from Dickens's pen or the result of later handling of the Notes. Stone's transcriptions do not include it in his rendering of the non-textual markings on the Note (Stone 207).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN01.json","id":"f9876ff3-3de2-45e5-81d0-ed4e34a40f42.json"},"f9e017e5-af8d-4856-9aa4-cb25561b9d76.json":{"content":"BH.VI.R8 \nGolden Cross of St Pauls\nWhile composing No. VI in early July, Dickens received a letter from the Rev. Henry Christopherson challenging him on his attack on Christian missionaries in ch. 16 of the prior number. Christopherson complained to Dickens: \"I venture to trespass on your attention with one serious query, touching a sentence in the last number of Bleak House. Do the supporters of Christain missions to the heathen really deserve the attack that is conveyed in the sentence about Jo seated in his anguish on the doorstep of the Society for the Propagation of the Gospel in Foreign Parts? The allusion is severe, but is it just? Are such boys as Jo neglected? What are the ragged schools, town missions, and many of those societies I regret to see sneered at in the last number of Household Words?\" (Letters 6.706fn5). Dickens replied to Christopherson on July 9th, reiterating the novel's sustained critique of \"telescopic philanthropy\": \"If you think the balance between the home mission and the foreign mission justly held in the present time–I do not. [...] I am decidedly of opinion that the two works, the home and the foreign, are not conducted with an equal hand; and that the home claim is by far the stronger and the more pressing of the two. Indeed, I have very grave doubts whether a great commercial country holding communication with all parts of the world, can better christianise the benighted portions of it than by the bestowal of its wealth and energy on the making of good Christians at home and on the utter removal of neglected and untaught childhood from its streets, before it wanders elsewhere\" (Letters 6.707). \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"f9e017e5-af8d-4856-9aa4-cb25561b9d76.json"},"fa501246-d08c-4c99-af7a-06b0cecbd35e.json":{"content":"BH.VII\nWith No. VII, Dickens switched to using blue ink in both manuscript and Working Notes. Given that he returns to using black ink in the manuscript in No. X, this change in inks likely corresponds to his physical movement. Dickens moved to rented lodgings in Dover with his family from the end of July, before traveling to Boulogne in early October. Through the month of August, Dickens was busy preparing for the Guild of Literature and Art's theatrical tour, which began on the 23rd of August in Nottingham with performances in Derby, Newcastle, Sunderland, Sheffield, Manchester, and Liverpool over the following fortnight. The Working Notes for the previous number (No. VI) and No. IX contain both blue and black ink, which suggests that many of those memoranda were made after the completion of those numbers.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN07.json","id":"fa501246-d08c-4c99-af7a-06b0cecbd35e.json"},"fac9edf4-92f8-44e4-a13e-91c68d6a04fa.json":{"content":"BH.VI.L1 \nCarry through, his character – developing itself\nA number of key threads and later developments are carefully orchestrated by Dickens in No. VI, highlighted by Dickens's varied replies to his queries on this Working Note (\"Carry through,\" \"not much,\" \"slightly\"). In addition to these character elements of Richard and others, the number also lays the foundations for several central plot developments: the romance between Esther and Woodcourt, Lady Dedlock's revelation to Esther, and the central role Jo will play in the novel's social critique. Late in July Dickens's intimates his sense of these larger developments in a letter to Mary Boyle (22 July): \"to let you into a secret I am not quite sure that I ever did like, or ever shall like, anything quite so well as Copperfield. But I foresee (I think) some very good things in Bleak House\" (Letters 6.721). \n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN06.json","id":"fac9edf4-92f8-44e4-a13e-91c68d6a04fa.json"},"faef612e-6390-4991-8792-2af9dd4947f9.json":{"content":"BH.IX.L3 \nYes\nThe different color of ink for this answer suggests that Dickens makes this note when he records the more detailed chapter notes on the right-hand side. Mr Rouncewell and Rosa appear in chapter 29, and Watt is prominent insofar as his father announces Watt's intention to marry Rosa to Sir and Lady Dedlock. As seen in Working Notes to this point, Dickens has managed the burgeoning romance between Watt and Rosa carefully in the early numbers in anticipation of this event. The uncertainty here about whom to include (\"or...or...\") could indicate uncertainty about when and how to formalize Watt's courtship of Rosa.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN09.json","id":"faef612e-6390-4991-8792-2af9dd4947f9.json"},"fc1bfc5e-a92b-45f3-9480-8d2f719e383f.json":{"content":"BH.XII.R1 \nInterview with her mother\nEsther's meeting with her mother is one of the more heavily revised and reworked sections in the entire manuscript of Bleak House. At proof stage, Dickens continued to make changes, including a small but significant change to the close of their interview. In the published text, Esther describes their parting by saying, \"We held one another for a little space yet, but she was so firm that she took my hands away, and put them back against my breast, and with a last kiss as she held them there, released them, and went from me into the wood\" (BH 582). The sentence was originally written as \"We embraced one another [...]\" before Dickens changed \"embraced\" to \"held\" in the corrected proofs.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN12.json","id":"fc1bfc5e-a92b-45f3-9480-8d2f719e383f.json"},"fc9913c9-e931-4a88-9ae8-a763000f69cb.json":{"content":"BH.I.R7\nTelescopic Philanthropy\nThis chapter is first given a much longer title in the manuscript, which has been deleted and replaced with \"Telescopic Philanthropy.\" That original title cannot be read beneath Dickens's blots, but the first word does still appear to be \"Telescopic.\"\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN01.json","id":"fc9913c9-e931-4a88-9ae8-a763000f69cb.json"},"fd6e3087-1011-41f5-9845-7890cdf5e71f.json":{"content":"BH.XII.R5 \nA Struggle.\nTwo sets of corrected proofs have been retained for Chapter 38. On the first, earlier set Dickens adds the title for chapter 38 in ink; it then appears in type in the second set.\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN12.json","id":"fd6e3087-1011-41f5-9845-7890cdf5e71f.json"},"fff0e458-8797-4daf-b068-73e7b34532d1.json":{"content":"BH.XII.R3 \nMeeting with Ada.\nEsther's removal to Boythorn's house in Lincolnshire to recuperate following her illness sets up three encounters: first her confrontation with her own image in the mirror, then her dramatic encounter with her mother in the grounds of Chesney Wold, and finally her reunion with Ada. Although there is significant attention to the anticipation Esther feels in advance of her meeting with Ada, the meeting itself is described in just a few sentences to close the chapter. However, the brief description of Ada embracing Esther creates a poignant contrast with Lady Dedlock's insistence that they \"'shall meet no more'\" (BH 582) after their first and only meeting: \"[Ada] ran in, and was running out again when she saw me. Ah, my angel girl! the old dear look, all love, all fondness, all affection. Nothing else in it–no, nothing, nothing! O how happy I was, down upon the floor, with. my sweet beautiful girl down upon the floor too, holding my scarred face to her lovely cheek, bathing it with tears and kisses, rocking me to and fro like a child, calling me by every tender name that she could think of, and pressing me to her faithful heart\" (BH 588).\n ","tags":"","url":"https://dickensnotes.github.io/dickens-annotations/canvas/img/derivatives/iiif/bleakhousetranscriptions/BHWN12.json","id":"fff0e458-8797-4daf-b068-73e7b34532d1.json"}}
